//Creating a class to instantiate plant objects
class Plant {
  constructor(commonName, scientificName, division, plantClass, subclass, order, family, commonFamily, genus, species, imageSrc, imageCite, duration, description, citeYear, url) {
    this.commonName = commonName;
    this.scientificName = scientificName;
    this.classification = {kingdom: 'Plantae', division, plantClass, subclass, order, family, commonFamily, genus, species}
    this.imageSrc = imageSrc;
    this.imageCite = imageCite;
    this.duration = duration;
    this.description = description;
    this.descriptionCite = `Illinois Department of Natural Resources. ${citeYear}. Native Plant Information. Retrieved from ${url}`;
  }
  
  lowerCaseAndRemoveSpace(prop) {
    return this[prop].toLowerCase().split(' ').join('');
  }
}

//Creating the array of plant objects
const plants = [
  new Plant('American bellflower', 'Campanulastrum americanum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Campanulales', 'Campanulaceae Juss.', 'Bellflower family', 'Campanulastrum Small', 'Campanulastrum americanum', 'https://s7d1.scene7.com/is/image/isp/fygoct2019?qlt=100&wid=900&ts=1689692279748&$ImageComponent$&fit=constrain', null, 'Annual', 'American bellflower is an annual or biennial herb. Its sap is milky. The erect stem may be branched. Leaves are arranged alternately along the stem. Each simple, lance‐shaped leaf is toothed. A single leaf may be six inches long and two inches wide. The five-petaled, pale‐blue flowers are flat and have a lighter ring at the center. The style (part of the female reproductive structures) is very long and curved. Flowers develop in a cluster on a stalk that may be one and one‐half feet long. The fruit is a club‐shaped capsule, about one‐half inch long, containing flat, brown seeds. American bellflower may attain a height of one and one‐half to six feet and may be found throughout Illinois. It grows in woodlands. Flowers are produced from June through November. White‐tailed deer may eat the leaves of this plant.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygoct2019.html'), 
  new Plant('American Gromwell', 'Lithospermum latifolium', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Boraginaceae Juss.', 'Borage family', 'Lithospermum L.', 'Lithospermum latifolium', 'https://s7d1.scene7.com/is/image/isp/fygapr2019?qlt=100&wid=900&ts=1689613784387&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd.', 'Perennial', 'American gromwell grows in rich woodlands statewide. An individual plant may be one and one-half to two and one-half feet tall. Its stems and leaves are covered with small hairs. Flowers develop individually from the leaf axils at the stem tip. Flower color is yellow. The fruit is a nutlet. Long-tongued bees and butterflies are pollinators that can take advantage of the flowers.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygapr2019.html'), 
  new Plant('Arrow Arum', 'Peltandra virginica', 'Magnoliophyta', 'Liliopsida', 'Arecidae', 'Arales', 'Araceae Juss.', 'Arum family', 'Peltandra Raf.', 'Peltandra virginica', 'https://s7d1.scene7.com/is/image/isp/fygjul2022?qlt=100&wid=900&ts=1689602028963&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Arrow arum is an aquatic plant that grows in areas of shallow, standing water such as swamps and ditches. It prefers shaded water. It is present in all but the counties of far north central and northwestern Illinois. Its leaves and flower stalks emerge from the water. The plant grows 12-24 inches tall. The leaves are large and arrow-shaped. This species blooms from May through June. The flowers are on a club-shaped structure called a spadix that is surrounded by a leaflike, elongated spathe. The flowers do not have petals or sepals. Fruits are green berries. Flies are attracted by the smell from the flowers and act as pollinators as they feed on the pollen. Waterfowl and some wading birds eat the fruits.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygjul2022.html'), 
  new Plant('Azure Aster', 'Symphyotrichum oolentangiense', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum oolentangiense', 'https://s7d1.scene7.com/is/image/isp/fygnov2018?qlt=100&wid=900&ts=1689692867507&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Azure aster, also known as sky blue aster, is found statewide in prairies, woodland openings and savannas. The plants grow to about three feet tall. Leaves are arranged alternately along the stem. Leaf size and leaf stalk length decrease from the base of the plant to the top. Flowers are present from August through November. Many flower heads are present at the top of the plant. Ray flowers are blue or purple. The flowers are important sources of nectar and pollen for many pollinators. The seeds and leaves also provide food for several species of wildlife.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygnov2018.html'), 
  new Plant('Big bluestem', 'Andropogon gerardii', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Andropogon L.', 'Andropogon gerardii', 'https://s7d1.scene7.com/is/image/isp/bnbigblue?qlt=100&wid=600&ts=1689704368676&$ImageComponent$&fit=constrain', null, 'Perennial', 'You may not consider winter as a time to think about or be impressed by the plants in your garden. Winter gardens can be beautiful, though, and provide important habitat for wildlife. As you plan for your garden this year, consider including some native grasses. Leaving them year round can be a pleasing experience for you, and they require very little maintenance. Native prairie grasses are resistant to cold and drought and are rarely attacked by disease and insects. They are perennials that you can enjoy year after year. Big bluestem is the State Prairie Grass of Illinois. It can grow to a height of six to eight feet. In summer, the leaves are blue-green, thus this plant\'s common name. In fall the leaves turn yellow and bronze. Recommended to be planted far enough from other plants in your garden to give them room to grow and to avoid entanglements with other plants. Since these are tall plants, the back of the garden is a good place for them.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygjan2008.html'), 
  new Plant('Black-eyed Susan', 'Rudbeckia hirta', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Rudbeckia L.', 'Rudbeckia hirta L.', 'https://s7d1.scene7.com/is/image/isp/bnbesusan?qlt=100&wid=900&ts=1689703803893&$ImageComponent$&fit=constrain', null, 'Annual, Biennial, or Perennial', 'Black-eyed Susan can be found in moist prairies, open woods, pastures, fields, roadsides and savannas in the eastern half of the state. This plant has upright, hairy stems. The simple, lance‐shaped leaves are arranged alternately along the stem. Each hairy leaf has teeth that are widely spaced along the margin. Flowering occurs from June through October. One flower head is produced per plant, although sometimes the plant branches near the base and produces one flower per stem. The flower head contains many small flowers that are of two types: yellow ray flowers (10 to 20 per flower head), about three-fourths inch long; and purple‐brown, tubular flowers in the dome‐shaped center. Some individual plants may have pale‐yellow ray flowers with white tips. Each flower head is about two and one‐half to two and three‐fourths inches wide. This plant may grow to a height of two to three feet. Black-eyed Susan is a short-lived perennial or a biennial (living two years). It readily grows from its seeds, though. The flower heads attract a variety of pollinating insects.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygsep2017.html'), 
  new Plant('Blackhaw', 'Viburnum prunifolium', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Dipsacales', 'Caprifoliaceae Juss.', 'Honeysuckle family', 'Viburnum L.', 'Viburnum prunifolium L.', 'https://s7d1.scene7.com/is/image/isp/fygsep2013?qlt=100&wid=900&ts=1689600643119&$ImageComponent$&fit=constrain', null, 'Perennial', 'Blackhaw is a small tree that grows along streams, in woods and on wooded slopes throughout Illinois. It may reach a height of 25 feet with a diameter of six inches. The bark is red-brown with many fissures. Its leaves are simple and arranged oppositely on the stem. A single leaf may be up to three inches long and two inches wide. The leaf edge is very finely toothed. Flowers are produced from April through June. These white flowers form in broad, rounded clusters. The resulting blue-black fruits are fleshy, contain one seed and are readily eaten by wildlife. Fall leaf colors on this small tree are outstanding.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygsep2013.html'), 
  new Plant('Blazing star', 'Liatris spicata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Liatris Gaertn. ex Schreb.', 'Liatris spicata (L.)', 'https://s7d1.scene7.com/is/image/isp/bnroughbstar?qlt=100&wid=900&ts=1689884463915&$ImageComponent$&fit=constrain', null, 'Perennial', 'There are several species of blazing-star native to Illinois. Their tall spikes of purple flowers can be seen throughout the state from July until late fall. Most commonly associated with prairies, blazing-star varieties are also adapted to savannas, open woods, wet meadows, fens and sandy areas. The plants can grow to a height of about five feet. The stem is unbranched and is covered with a spiral of long, narrow leaves. The plant grows from a corm, an underground stem with scaly leaves that is similar in appearance to a bulb.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygsep2008.html'), 
  new Plant('Bloodroot', 'Sanguinaria canadensis', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Papaverales', 'Papaveraceae Juss.', 'Poppy family', 'Sanguinaria L.', 'Sanguinaria canadensis L.', 'https://s7d1.scene7.com/is/image/isp/fygmar2011?qlt=100&wid=900&ts=1689617320297&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd.', 'Perennial', 'Bloodroot blooms from March through April in rich woodlands throughout Illinois. This plant is a member of the poppy family. When broken, the stem produces an orange-red sap. As the plant’s stem grows underground, its common name is “bloodroot.” The lobed leaf wraps around the flower stalk. The plant grows from six to 12 inches tall and produces a prominent white flower. The rhizomes of this plant slowly spread, and after a few years a small colony of the plants can develop.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygmar2011.html'), 
  new Plant('Blue cohosh', 'Caulophyllum thalictroides', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Berberidaceae Juss.', 'Barberry family', 'Caulophyllum Michx.', 'Caulophyllum thalictroides (L.) Michx.', 'https://s7d1.scene7.com/is/image/isp/fygmar2021?qlt=100&wid=600&ts=1689691895765&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Blue cohosh grows statewide in moist woods. Flowers are produced in April and May. The flowers are six-parted and are green-yellow to brown. Its fruits are dark-blue berries. The leaves have seven to nine leaflets. A single plant may be one to three feet tall. The flowers attract pollinators, and the fruits are eaten by wildlife, particularly birds.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygmar2021.html'), 
  new Plant('Blue vervain', 'Verbena hastata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Verbenaceae J. St.-Hil.', 'Verbena family', 'Verbena L.', 'Verbena hastata L.', 'https://s7d1.scene7.com/is/image/isp/fygapr2016?qlt=100&wid=900&ts=1701120339019&$ImageComponent$&fit=constrain', null, 'Perennial', 'Blue vervain is found throughout Illinois in moist woodlands, moist prairies and moist disturbed areas. Flowering occurs from June through October. The blue-to-purple flowers develop on small spikes. Flowers mature first at the bottom of each spike and blooming progresses upward to the tip of the spike. The stem is four-sided and grooved. This plant may reach a height of six feet.  It is a good species for pollinators.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygapr2016.html'), 
  new Plant('Bluebells', 'Mertensia virginica', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Boraginaceae Juss.', 'Borage family', 'Mertensia Roth', 'Mertensia virginica (L.)', 'https://s7d1.scene7.com/is/image/isp/fygfeb2013?qlt=100&wid=900&ts=1689611832420&$ImageComponent$&fit=constrain', null, 'Perennial', 'Bluebells, also known as Virginia cowslip or mertensia, grow in moist woods and floodplain forests throughout Illinois. Flowers are present from March through June. Flowers are generally blue in color, although white flowers and rose-colored flowers are sometimes present. The flower bud is pink. Like all members of the forget-me-not family, the flowers are produced at the top of the stem, on one side of the stem. Flowers are large and tubular. They hang so that the flower opening faces the ground. The leaves are arranged alternately on the stem. Each leaf is oval and smooth. The plant grows to one to two feet in height.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygfeb2013.html'), 
  new Plant('Blue-eyed Mary', 'Collinsia verna', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Scrophulariales', 'Scrophulariaceae Juss.', 'Figwort family', 'Collinsia Nutt.', 'Collinsia verna Nutt.', 'https://s7d1.scene7.com/is/image/isp/fygjun2010?qlt=100&wid=900&ts=1700593692115&$ImageComponent$&fit=constrain', 'Photo © 2009, River Valley Photographic Resources, Ltd., rvprltd.com', 'Annual', 'Blue-eyed Mary grows statewide in Illinois in rich woods. A member of the snapdragon family, this species blooms from April through June. The distinctive flowers have upper lobes that are white and lower lobes that are bright blue. The plant may grow to 24 inches tall. Leaves are lance-shaped and arranged oppositely on the stem.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygjun2010.html'), 
  new Plant('Browneyed Susan', 'Rudbeckia triloba L.', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Rudbeckia L.', 'Rudbeckia triloba L.', 'https://s7d1.scene7.com/is/image/isp/fygmar2016?qlt=100&wid=900&ts=1701120038975&$ImageComponent$&fit=constrain', null, 'Perennial', 'Brown-eyed Susan is found throughout Illinois in fields, woodlands and along streams. Flowering occurs from June through October. Numerous flowers are produced per plant. The petallike ray flowers are yellow and surround the cone-shaped, dark brown center. Leaves are arranged alternately on the stem. The plant may reach a height of five feet. The flowers of this plant are important to pollinator species.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygmar2016.html'), 
  new Plant('Butterfly Milkweed', 'Asclepias tuberosa', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Gentianales', 'Asclepiadaceae Borkh.', 'Milkweed family', 'Asclepias L.', 'Asclepias tuberosa L.', 'https://s7d1.scene7.com/is/image/isp/bnbutterweed?qlt=100&wid=900&ts=1689704438410&$ImageComponent$&fit=constrain', null, 'Perennial', 'The flowers of butterfly-weed can be seen in the woods, prairies and savannas of Illinois from May through September. It grows particularly well in sandy soil. Typically the flowers are orange, but they can also be shades of yellow and red. The stems are hairy with leaves generally alternate, but leaves may be opposite on the upper part of the stem. The plant grows to a height of two to three feet. The sap of this species is clear, unlike the white sap of other milkweeds. The seed pods are five to six inches in length. As its common name indicates, the plant attracts butterflies as a food source for both adults and larvae.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygjul2013.html'), 
  new Plant('Buttonbush', 'Cephalanthus occidentalis', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Rubiales', 'Rubiaceae Juss.', 'Madder family', 'Cephalanthus L.', 'Cephalanthus occidentalis L.', 'https://s7d1.scene7.com/is/image/isp/fygdec2013?qlt=100&wid=600&ts=1689604005516&$ImageComponent$&fit=constrain', null, 'Perennial', 'Buttonbush is a shrub that grows in wet areas throughout the state. It usually reaches a height in the range of three to eight feet. Flowering occurs in June, July and August. The flowers are white, tiny and arranged in a sphere that is one to one and a half inches in diameter. The leaves may be up to eight inches long and three inches wide. The leaves are dark green on the surface and arranged in pairs or whorls of three or four. The fruit is a red-brown nutlet. Nutlets develop in clusters.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygdec2013.html'), 
  new Plant('Calico Aster', 'Symphyotrichum lateriflorum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum lateriflorum (L.) Á. Löve & D. Löve', 'https://s7d1.scene7.com/is/image/isp/fygoct2022?qlt=100&wid=900&ts=1689691176042&$ImageComponent$&fit=constrain', null, 'Perennial', 'Calico aster grows in moist soils statewide. It reaches a height of one to three feet. The stems are light green or dark red-brown and have white hairs on them. Leaves grow alternately on the stem and become smaller from the bottom to the top of the stem. Leaf shape varies. Flower heads develop in clusters on the upper stem tips and some of the side stem tips. Blooming occurs from August through October. Each flower head has 8-12 ray flowers around a center of disk flowers. The disk flowers are yellow initially but change to brown or purple-red. The ray flowers are white. The fruit is an achene, a simple dry fruit that does not open at maturity. The achenes have small tufts of white hairs. Many species of insects are attracted to the flowers. The seeds are eaten by songbirds and game birds in winter.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygoct2022.html'), 
  new Plant('Canada Milkvetch', 'Astragalus canadensis', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Astragalus L.', 'Astragalus canadensis L.', 'https://s7d1.scene7.com/is/image/isp/fygaug2020?qlt=100&wid=600&ts=1689691768831&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Canada milk vetch is a perennial herb. Its pinnately compound leaves have small, oval leaflets in seven to 15 pairs. Leaves are arranged alternately along the stems. The five‐petaled, pealike flowers are pale yellow or white. The fruit is a pod that contains seeds. This plant grows to about four feet in height. Canada milk vetch may be found throughout Illinois. It grows in prairies and thickets. Flowers are produced from June through August. It is a good species for pollinators.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygaug2020.html'), 
  new Plant('Cardinalflower', 'Lobelia cardinalis', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Campanulales', 'Campanulaceae Juss.', 'Bellflower family', 'Lobelia L.', 'Lobelia cardinalis L.', 'https://s7d1.scene7.com/is/image/isp/fygjul2008?qlt=100&wid=900&ts=1689600598803&$ImageComponent$&fit=constrain', null, 'Perennial', 'The brilliant red blossoms of cardinal-flower are present from July through October. Each flower may be two inches long, and the flower has an upper two-lobed lip and a lower three-lobed lip. This plant naturally grows in marshes, wet meadows, wet prairies and along streams, ponds and lakes, so you will want to be sure that there is plenty of soil moisture available where you plant it. The cardinal-flower plant can grow very tall if conditions are favorable. Leaves are arranged alternately on the stem. The leaves and stem are usually fuzzy. A single leaf may be up to eight inches long and two and one-half inches wide. Cardinal-flower can be found throughout Illinois.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygjul2008.html'), 
  new Plant('Carolina Rose', 'Rosa carolina', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Rosales', 'Rosaceae Juss.', 'Rose family', 'Rosa L.', 'Rosa carolina L.', 'https://s7d1.scene7.com/is/image/isp/fygjul2015?qlt=100&wid=900&ts=1701106593916&$ImageComponent$&fit=constrain', null, 'Perennial', 'Carolina rose, also known as pasture rose, grows in prairies, upland woods and fields throughout Illinois. It may attain a height of one to three feet, although it typically is a low-growing plant. Flowers are produced from May through July. Each flower contains five pink petals and five green sepals. The leaves are compound and composed of three to seven leaflets. Leaves are arranged alternately along the stem. Thin, straight thorns in pairs are present at the leaf base. Fruits are red, spherical "hips" that can provide food for wildlife in the fall and winter.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygjul2015.html'), 
  new Plant('Celandine Poppy', 'Stylophorum diphyllum', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Papaverales', 'Papaveraceae Juss.', 'Poppy family', 'Stylophorum Nutt.', 'Stylophorum diphyllum (Michx.) Nutt.', 'https://s7d1.scene7.com/is/image/isp/fygmar2008?qlt=100&wid=900&ts=1689613869397&$ImageComponent$&fit=constrain', null, 'Perennial', 'Celandine poppy, or wood poppy, is a perennial plant with hairy stems that grow to about one foot in height. The stems have yellow sap that was commonly used as a dye by Native Americans. Leaves grow from the base of the plant and along the stem. The hairy leaves are pinnately lobed, with each leaf up to about 10 inches long. Flowers arise in clusters of up to four at the stem tip. There are four yellow petals per flower, and each flower may be two inches wide. The fruit is a hairy capsule, up to one inch long. Celandine poppy grows in naturally in the rich wet woods of the southern one-fourth of Illinois as well as in Vermilion and Cook counties. Flowers are produced from March through May.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygmar2008.html'), 
  new Plant('Christmas Fern', 'Polystichum acrostichoides', 'Pteridophyta', 'Filicopsida', null, 'Polypodiales', 'Dryopteridaceae Herter', 'Wood Fern family', 'Polystichum Roth', 'Polystichum acrostichoides (Michx.) Schott', 'https://s7d1.scene7.com/is/image/isp/fygjan2009?qlt=100&wid=900&ts=1700581224902&$ImageComponent$&fit=constrain', null, 'Perennial', 'The Christmas fern is a perennial plant that retains green foliage all year. The leaves may grow to about 20 inches in length. Each of the pinnae, units of the blade or leaf, is lance- or oblong-shaped. Pinnae are smooth on the upper surface, have tiny serrations along the edge and have a projection at the base. The pinnae at the bottom of the blade are larger than those at the top and are sterile. More than 30 pairs of pinnae may be present per leaf. Christmas fern grows naturally in Illinois woodlands in the southern two-thirds of the state, often associated with areas where rocks are present. It is a good choice for a shaded rock garden. It is called "Christmas" fern because it was gathered and used by pioneers for decorations during the holiday season.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygjan2009.html'), 
  new Plant('Closed Bottle Gentian', 'Gentiana andrewsii', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Gentianales', 'Gentianaceae Juss.', 'Gentian family', 'Gentiana L.', 'Gentiana andrewsii Griseb.', 'https://s7d1.scene7.com/is/image/isp/fygsep2020?qlt=100&wid=600&ts=1689614342718&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Closed gentian is a perennial herb. Its sessile leaves are oval to lance‐shaped with a point at the tip. The simple, entire leaves are arranged opposite each other on the stem. The flowers have deep‐blue to violet petals that remain closed or nearly closed. The petals are connected by a white membrane that sticks out slightly beyond their tips. Flowers are arranged either in a cluster at the stem tip or in the upper leaf axils. The fruit is a capsule that contains seeds. Closed gentian may grow to a height of one to two feet. This species may be found statewide, although it is more commonly seen in the northern one‐half of Illinois than in the southern one‐half. It grows in moist woods and wet prairies. Flowers are produced from August through October.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygsep2020.html'), 
  new Plant('Red Columbine', 'Aquilegia canadensis', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Aquilegia L.', 'Aquilegia canadensis L.', 'https://s7d1.scene7.com/is/image/isp/fygmay2008?qlt=100&wid=900&ts=1689691947888&$ImageComponent$&fit=constrain', null, 'Perennial', 'Growing from thick roots, the upright, branched stems of columbine may reach two feet in height. This perennial plant has leaves at the base of the plant that are doubly compound, while the leaves on the upper stems are divided and do not have stalks. Flowers are produced in clusters at the stem tip, and a single flower may be two and one-half inches long on a slender stalk. The five petals are projected backwards into five hollow spurs that are red outside and yellow inside. The genus name Aquilegia refers to “eagle,” and the five spurs resemble an eagle\'s claws. Columbine grows in rocky woods statewide and flowers from mid-April to July.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygmay2008.html'), 
  new Plant('Common Boneset', 'Eupatorium perfoliatum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Eupatorium L.', 'Eupatorium perfoliatum L.', 'https://s7d1.scene7.com/is/image/isp/fygmar2017?qlt=100&wid=900&ts=1689603194189&$ImageComponent$&fit=constrain', null, 'Perennial', 'Common boneset is also known as perfoliate boneset. Found statewide, this species thrives in swamps, wet meadows, wet prairies, sloughs, around ponds and lakes and along streams. This plant has white, hairy stems that may grow to five feet tall. The lance-shaped leaves are arranged opposite each other on the stem. Leaves are white, hairy, toothed, up to six inches long and up to two inches broad. Flowers are produced from July through October. They develop in small heads with five white petals per flower. Petals form a tube. Fruits are single seeds about one-tenth inch long, each with a tuft of white bristles.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygmar2017.html'), 
  new Plant('Common Milkweed', 'Asclepias syriaca', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Gentianales', 'Asclepiadaceae Borkh.', 'Milkweed family', 'Asclepias L.', 'Asclepias syriaca L.', 'https://s7d1.scene7.com/is/image/isp/bncmilkweed?qlt=100&wid=900&ts=1689704614218&$ImageComponent$&fit=constrain', null, 'Perennial', 'Common milkweed grows in fields, roadsides and prairie edges throughout Illinois. Flowering occurs from May through August. The flowers may be purple-brown, rose or purple-pink. Flowers are produced in a cluster at the stem tip and from the leaf axils of the upper leaves. Although there are many flowers in a cluster, usually only a few of them are pollinated. The pollinated flowers develop into large pods that contain seeds attached to silky plumes. Common milkweed pods are easily identified by the many projections on their surface. These plants may grow to nearly five feet tall. Their leaves are arranged oppositely on the stem. Each leaf may be up to eight inches long and 4.5 inches wide. The veins in the leaves usually have a pink tinge. The stem is generally not branched and is covered with small hairs. The sap of common milkweed is white. Monarch butterfly larvae are among the few organisms that are able to eat milkweed leaves. Many pollinators are attracted to the flowers, however.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygaug2014.html'), 
  new Plant('Common Mountainmint', 'Pycnanthemum virginianum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Lamiaceae Martinov', 'Mint family', 'Pycnanthemum Michx. ', 'Pycnanthemum virginianum (L.) T. Dur. & B.D. Jacks. ex B.L. Rob. & Fernald', 'https://s7d1.scene7.com/is/image/isp/bnmountainmint?qlt=100&wid=900&ts=1689881970445&$ImageComponent$&fit=constrain', null, 'Perennial', 'Common mountain mint grows in fens, marshes and prairies throughout Illinois, although it is more frequently found in the northern one-half of the state. It blooms from July through September. The flowers are white, small and produced in clusters at the stem tip. Only a few flowers bloom in each cluster at one time. Leaves are narrow, smooth and without teeth along the edge. Like all mints, it has a square stem. This plant grows one and one-half to two feet in height. It attracts a variety of pollinators.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygaug2016.html'), 
  new Plant('Common Phlox', 'Phlox divaricata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Solanales', 'Polemoniaceae Juss.', 'Phlox family', 'Phlox L.', 'Phlox divaricata L.', 'https://s7d1.scene7.com/is/image/isp/fygapr2008?qlt=100&wid=900&ts=1673474781895&$ImageComponent$&fit=constrain', null, 'Perennial', 'The lovely flowers of common phlox, also known as sweet William, start to grace the forest floor in mid-April and continue blooming through early June. Its stems grow upright or creeping and may be up to one and one-half feet long. The leaves are oblong or oval and arranged opposite each other on the stem. Each finely hairy leaf may be up to four inches long. The light purple to blue flowers develop in clusters at the stem tip. Each flower has five petals. A single flower may be one and one-fourth inches wide. The seeds are contained in a capsule. Common phlox can be found statewide growing in rich open woods. This plant can add a beautiful splash of color to your spring shaded garden.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygapr2008.html'), 
  new Plant('Common Polypody', 'Polypodium virginianum', 'Pteridophyta ', 'Filicopsida', null, 'Polypodiales', 'Polypodiaceae J. Presl & C. Presl', 'Polypody family', 'Polypodium L.', 'Polypodium virginianum L.', 'https://s7d1.scene7.com/is/image/isp/fygnov2011?qlt=100&wid=900&ts=1673475465772&$ImageComponent$&fit=constrain', null, 'Perennial', 'Common polypody is a fern that grows naturally in Illinois in shady areas on sandstone rocks and wooded slopes and on dunes. It is found in the southern and northern thirds of the state but is absent from central Illinois. Its spore-producing structures form on the back of the leaf from June through October. The leaves may grow to 10 inches long. Leaves are evergreen and provide wonderful color for your garden throughout the fall and winter. Ferns require very little care.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygnov2011.html'), 
  new Plant('Compassplant', 'Silphium laciniatum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl ', 'Aster family', 'Silphium L.', 'Silphium laciniatum L.', 'https://s7d1.scene7.com/is/image/isp/bncompassplant?qlt=100&wid=900&ts=1689885735823&$ImageComponent$&fit=constrain', null, 'Perennial', 'Compass-plant grows in prairies and along roadsides throughout the state, although it is not as commonly found in the southern counties as it is in the rest of Illinois. The basal leaves can be about one foot in length, and smaller leaves are present in an alternating pattern on the flower stalk. The basal leaves have many divisions. The flower stalk can reach eight feet in height. Compass-plant blooms from June through September. The flowers are yellow with a yellow center and are produced at the tip of the flowering stalk. Compass-plant got its common name because its leaves are held vertically in a north to south plane.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygsep2009.html'), 
  new Plant('Longbract Wild Indigo', 'Baptisia bracteata', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Baptisia Vent.', 'Baptisia bracteata Muhl. ex Elliott', 'https://s7d1.scene7.com/is/image/isp/fygmay2011?qlt=100&wid=900&ts=1689612909070&$ImageComponent$&fit=constrain', 'Photo © 2009, River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Cream wild indigo has two natural varieties in Illinois. One grows in moist prairies and open woods in the northern 4/5 of the state, while the other variety is rare and grows in west central and southern Illinois. Its growth form is low and bushy. The leaves are sessile and hairy. This plant may reach one foot tall and two to two and one-half feet wide. It blooms in May and June. The flowers are cream yellow and develop in horizontal to drooping clusters about eight inches long. In the garden, this species grows best with sun to partial shade conditions. It can be planted in dry to moist soil and is slow-growing but long-lived.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygmay2011.html'), 
  new Plant('Culver\'s-root', 'Veronicastrum virginicum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Scrophulariales', 'Scrophulariaceae Juss.', 'Figwort family', 'Veronicastrum Heist. ex Fabr.', 'Veronicastrum virginicum (L.) Farw.', 'https://s7d1.scene7.com/is/image/isp/bnculversroot?qlt=100&wid=900&ts=1701098787694&$ImageComponent$&fit=constrain', null, 'Perennial', 'Culver\'s-root grows throughout Illinois in prairies and woodlands. It is sometimes called the candelabra plant for its spikes of white flowers that are arranged somewhat like a candelabrum. Flowers are produced from June through September. This member of the snapdragon family may grow to a height of five feet. The leaves are in whorls, and the whorls are fairly far apart on the stem. Each leaf may be six inches long and one inch wide.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygjun2013.html'), 
  new Plant('Cup Plant', 'Silphium perfoliatum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Silphium L.', 'Silphium perfoliatum L.', 'https://s7d1.scene7.com/is/image/isp/bncupplant?qlt=100&wid=900&ts=1700668784185&$ImageComponent$&fit=constrain', null, 'Perennial', 'Cup-plant is found throughout Illinois growing in moist areas along streams and in other moist soils. It flowers from July through October, and the yellow flowers are produced on single stems at the top of the plant. Cup-plant can grow to a height of eight feet. The leaves are large and coarsely toothed. The leaves are arranged oppositely on the stem, and the bases of these opposite leaves join around the stem to form a cup. Water does collect in the cup, and birds often drink from it.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygaug2011.html'), 
  new Plant('Doll\'s-eyes', 'Actaea pachypoda', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Actaea L.', 'Actaea pachypoda Elliott', 'https://s7d1.scene7.com/is/image/isp/fygfeb2019?qlt=100&wid=900&ts=1689692843358&$ImageComponent$&fit=constrain', null, 'Perennial', 'Doll’s-eyes plants grow in rich woodlands statewide. A plant may reach about two feet in height. It develops from an underground stem. Leaves are produced at the base of the plant and along the stem. The leaves are compound. Blooming occurs from April through June. Small, white flowers develop in an elongated cluster at the stem tip. Fertilized flowers produce an ovoid, white berry on a red stalk. The berry has a single purple dot, giving the fruit the appearance of a toy doll’s eye. The flowers have no nectar. Some bees are attracted to the flowers for their pollen. A few bird species eat the berries.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygfeb2019.html'), 
  new Plant('Downy Phlox', 'Phlox pilosa', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Solanales', 'Polemoniaceae Juss.', 'Phlox family', 'Phlox L.', 'Phlox pilosa L.', 'https://s7d1.scene7.com/is/image/isp/fygfeb2022?qlt=100&wid=900&ts=1689691583818&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Downy phlox is also known as prairie phlox. This perennial herb grows from slender roots. Its stems are hairy, upright and may reach two feet in height. The stems are sometimes branched. Leaves are arranged opposite each other on the stem. Each leaf is sessile and simple. Flowers are clustered at the stem tip. Each flower is attached to a thin, hairy stalk. Five, pink to light-purple petals are united at the bottom to form a tube. The fruit is an oblong capsule, up to one‐sixth inch in length. Downy phlox may be found statewide in Illinois. It grows in dry rocky woods and prairies. Flowers are produced from May through August. This species provides nectar for many long-tongued insect pollinators.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygfeb2022.html'), 
  new Plant('Downy Sunflower', 'Helianthus mollis', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Helianthus L.', 'Helianthus mollis Lam.', 'https://s7d1.scene7.com/is/image/isp/bndownysun?qlt=100&wid=900&ts=1689884406242&$ImageComponent$&fit=constrain', null, 'Perennial', 'Downy sunflower is also known as hairy sunflower, ashy sunflower and soft sunflower. Most of its leaves are paired. The stalkless, heart-shaped leaves clasp the stem. The entire plant is covered with white hairs. Flower heads are about two and one-half inches wide and bear yellow ray flowers around yellow disk flowers. The one-seeded fruit is dry and hard. Downy sunflower may grow two to three and one-half feet tall. This species may be found throughout Illinois growing in prairies. Flowers are produced from July through September. This species is an important food plant for grazing animals of the prairie. Downy sunflowers quickly form colonies as they spread from their underground stems.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygdec2016.html'),  
  new Plant('Drooping Coneflower', 'Ratibida pinnata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Ratibida Raf.', 'Ratibida pinnata (Vent.) Barnhart', 'https://s7d1.scene7.com/is/image/isp/bndroop?qlt=100&wid=900&ts=1689885715927&$ImageComponent$&fit=constrain', null, 'Perennial', 'Also known as yellow coneflower or gray-headed coneflower, this species may be found in prairie remnants and restorations in the northern three-fourths of Illinois and occasionally in the rest of the state. It blooms from July through October. The plant grows to two to four feet in height. Leaves have three to seven sections and are attached alternately to the stem. The yellow ray flowers droop and are attached to a central cone of tiny disc flowers.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygaug2008.html'), 
  new Plant('Dutchman\'s Breeches', 'Dicentra cucullaria', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Papaverales', 'Fumariaceae Marquis', 'Fumitory family', 'Dicentra Bernh.', 'Dicentra cucullaria (L.) Bernh.', 'https://s7d1.scene7.com/is/image/isp/fygfeb2008?qlt=100&wid=900&ts=1673474902462&$ImageComponent$&fit=constrain', null, 'Perennial', 'The Dutchman\'s-breeches plant develops from a bulb and can be found statewide growing in rich woodlands. There are no leaf-bearing stalks. The finely divided leaves arise from the base and provide an interesting accent to the garden. Flowers are present from mid-March through early May. Flowers are white with a yellow tip, and they develop in clusters on a leafless stalk that may be 10 inches tall. Individual flowers average two-thirds inch long and three-fourths inch wide. The four petals are arranged in two inflated pairs. Petals spread out and have pointed spurs at the base. Fruits are oblong to linear and contain several seeds.The plant\'s common name was bestowed because the flowers resemble wide-legged trousers worn by European men in historic times. Although the "breeches" are upside down on the flower stalk, it\'s not hard to imagine a pair of pantaloons hanging from a line and blowing in the wind when you look at these flowers. The Dutchman\'s-breeches plant contains an alkaloid that is poisonous to cattle.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygfeb2008.html'), 
  new Plant('Dwarf Larkspur', 'Delphinium tricorne', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Delphinium L.', 'Delphinium tricorne Michx.', 'https://s7d1.scene7.com/is/image/isp/fygapr2015?qlt=100&wid=900&ts=1689600536202&$ImageComponent$&fit=constrain', null, 'Perennial', 'The dwarf larkspur is a member of the buttercup family of plants. It grows in rich woodlands in all of Illinois except the northern one-fifth of the state. The plant grows from 12 to 30 inches tall. Its leaves have five to seven large divisions. Flowers are produced on a stalk. Each flower has a "spur" formed from a sepal. Flowers may be purple or white with blooming occurring in April and May.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygapr2015.html'), 
  new Plant('Early Meadow-rue', 'Thalictrum dioicum', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Thalictrum L.', 'Thalictrum dioicum L.', 'https://s7d1.scene7.com/is/image/isp/fygoct2021?qlt=100&wid=900&ts=1689601934105&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Early meadow rue grows in rich woods and prairies statewide. It has alternate, compound leaves, each up to one foot long. Flowers are borne in April and May. Plants produce either male or female flowers. The flowers develop in clusters at the stem tip, and they droop. There are no petals. The sepals are green-white to purple-brown. The flowers are pollinated by wind. A single plant may be up to two and one-half feet tall. The fruits are dry, hard and one-seeded. Some moth larvae feed on the leaves and stems.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygoct2021.html'), 
  new Plant('False Dragonhead', 'Physostegia virginiana', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Lamiaceae Martinov', 'Mint family', 'Physostegia Benth.', 'Physostegia virginiana (L.) Benth.', 'https://s7d1.scene7.com/is/image/isp/bnobplant?qlt=100&wid=900&ts=1689885795281&$ImageComponent$&fit=constrain', null, 'Perennial', 'False dragonhead is also known as obedience plant. It is found throughout Illinois in moist areas, particularly in wet prairie soils. It flowers from May through September. The flowers are produced in a spike at the top of a stem. Flowers vary in color but usually have a pink or red shade to them. The funnel-shaped flower looks something like a dragon\'s head, which is how the plant received its common name. The term "obedience plant" has been applied because if a flower is pushed to one side, it will stay there. This plant will grow to a height of one to five feet. As a member of the mint family, it has a square stem. The leaves are arranged oppositely along the stem.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygsep2011.html'), 
  new Plant('False Rue Anemone', 'Enemion biternatum', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Enemion Raf.', 'Enemion biternatum Raf.', 'https://s7d1.scene7.com/is/image/isp/fygmay2014?qlt=100&wid=900&ts=1701102492581&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'False rue anemone grows in woodlands throughout Illinois. Leaves are produced at the base of the plant and as compound leaves on stalks. The compound leaves have three leaflets. Flowers are produced from March through May. Each flower has five white sepals. There are no petals. Flowers are produced individually and in clusters of two or three. The plant may grow to about one foot in height. This plant is a member of the buttercup family.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygmay2014.html'), 
  new Plant('False Lily of the Valley', 'Maianthemum racemosum', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Maianthemum F.H. Wigg.', 'Maianthemum racemosum (L.) Link', 'https://s7d1.scene7.com/is/image/isp/fygjan2019?qlt=100&wid=900&ts=1673474903481&$ImageComponent$&fit=constrain', null, 'Perennial', 'False Solomon’s-seal grows in rich woodlands statewide. A plant may reach about two and one-half feet in height. It develops from an underground stem. Leaves are alternate and may be six inches long and three inches wide. Blooming occurs from April through June. Flowers develop in a cluster at the stem tip. The flower color is white. Fertilized flowers produce a spherical berry that is red or red with purple stripes when mature. Pollinating insects (bees, flies and beetles) are attracted to the flowers. Some birds and mammals eat the berries.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygjan2019.html'), 
  new Plant('Field Goldenrod', 'Solidago nemoralis', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Solidago L.', 'Solidago nemoralis Aiton', 'https://s7d1.scene7.com/is/image/isp/fygdec2020?qlt=100&wid=600&ts=1689691307645&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Field goldenrod is also known as gray goldenrod and old‐field goldenrod. Its gray‐green leaves are covered with fine, hairlike structures. Tiny leaflets are present in the axils of the leaves. The gray stem is densely covered with fine hairs. Both ray flowers (five to nine) and disk flowers are present in the yellow flower head. Many flowers are clustered on a stalk at the stem tip. Flowers tend to be present only on one side of the stalk. Field goldenrod may grow one and one‐half to three feet tall and is found statewide in Illinois. It grows in dry prairies, open woods, sandy soil, old pastures and fields. Flowers are produced from July through November. Many pollinators visit this species.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygdec2020.html'), 
  new Plant('Flat-topped Aster', 'Doellingeria umbellata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Doellingeria Nees', 'Doellingeria umbellata (Mill.) Nees', 'https://s7d1.scene7.com/is/image/isp/fygnov2020?qlt=100&wid=900&ts=1689691233529&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Flat-topped aster grows in fens, bogs and low areas in the northern one-half of the state. Flowers are produced from July through October. Flower heads develop in clusters at the stem tip. The ray flowers are white, while the disk flowers are yellow. The seeds produced from fertilized flowers are dry, hard and have a tuft of hairs. The plant may attain a height of two to five feet. Many pollinators are attracted to the flowers, and many other animals eat the seeds of this species.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygnov2020.html'), 
  new Plant('Flowering Dogwood', 'Cornus florida', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Cornales', 'Cornaceae Bercht. & J. Presl', 'Dogwood family', 'Cornus L.', 'Cornus florida L.', 'https://s7d1.scene7.com/is/image/isp/fygdec2011?qlt=100&wid=900&ts=1689617342217&$ImageComponent$&fit=constrain', null, 'Perennial', 'The flowering dogwood is a small tree that can reach up to 40 feet in height. It grows naturally in Illinois in woodlands in the southern one-half of the state. Flowering occurs from April through June. The yellow-green flowers are very small and arranged in clusters with each cluster surrounded by four large white bracts that are commonly referred to as petals. Flower buds have a distinctly different shape than leaf buds on this tree. The bark is brown and divided into square-shaped sections. Leaves are arranged oppositely on the stem. Each leaf has a smooth edge, oval shape and pointed tip. Leaves turn shades of red in the fall. The fruits are bright red berries that are a good source of food for wildlife in winter.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygdec2011.html'), 
  new Plant('Foxglove Beardstongue', 'Penstemon digitalis', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Scrophulariales', 'Scrophulariaceae Juss.', 'Figwort family', 'Penstemon Schmidel', 'Penstemon digitalis Nutt. ex Sims', 'https://s7d1.scene7.com/is/image/isp/bnfoxglove?qlt=100&wid=900&ts=1689618338635&$ImageComponent$&fit=constrain', null, 'Perennial', 'Foxglove beardstongue is found in woods and thickets statewide. It blooms from May through July. The plant grows to one to three feet in height. Leaves are opposite, and the base of the leaf clasps the stem. A leaf may be six inches long and two and one-half inches wide. Flower stalks arise in pairs from the base of the upper leaves. A member of the snapdragon family, this plant has white, tube-shaped flowers that have an upper two-lobed lip and a lower three-lobed lip. The name “beardstongue” was given because of the presence of a sterile, fuzzy stamen that looks like a beard.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygaug2012.html'), 
  new Plant('Golden Alexanders', 'Zizia aurea', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Apiales', 'Apiaceae Lindl.', 'Carrot', 'Zizia W.D.J. Koch', 'Zizia aurea (L.) W.D.J. Koch', 'https://s7d1.scene7.com/is/image/isp/fygmay2016?qlt=100&wid=900&ts=1689602362662&$ImageComponent$&fit=constrain', null, 'Perennial', 'The yellow flowers of golden Alexanders can be seen in savannas, moist woodlands, prairies and along streams from April through June. This member of the parsley family grows throughout Illinois but is less common in the southern one-fourth of the state.  It has multiple stems that produce flowers. The flowers are tiny and arranged in umbrellalike clusters (umbel) at the stem tip. The plant typically grows one to three feet tall. Leaves are compound and arranged alternately along the stem. It is a good species for pollinators.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygmay2016.html'), 
  new Plant('Goldenrod', 'Oligoneuron Small', 'Magnoliophyta', 'Manoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Oligoneuron Small', 'Oligoneuron', 'https://s7d1.scene7.com/is/image/isp/fygnov2008?qlt=100&wid=900&ts=1689604284290&$ImageComponent$&fit=constrain', null, 'Perennial', 'There are many species of goldenrods native to Illinois. They grow in prairies as well as disturbed areas. Their smooth stems are generally unbranched, except for those species where branches form at the top of the stem. The leaves are arranged alternately along the stem. Leaves are narrow, pointed at the tip, stiff and lack a stalk. The small, golden yellow flowers develop in large clusters at the stem tip. Flowers appear from August through September and may last until November if conditions are favorable. The dense roots of these plants help to hold the soil in place. Soldier beetles are attracted to these plants. They carry the sticky pollen from plant to plant as they feed on the flowers. As goldenrod pollen is carried by insects and not by wind, it is not a cause of hay fever, although this misconception persists.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygnov2008.html'), 
  new Plant('Goldenseal', 'Hydrastis canadensis', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Hydrastis L.', 'Hydrastis canadensis L.', 'https://s7d1.scene7.com/is/image/isp/fygmar2019?qlt=100&wid=900&ts=1689692787365&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Goldenseal may be found in rich woodlands statewide. The plant grows to about 10 inches tall. It has three leaves and a single flower. The flower develops from the base of the top leaf. There are no petals. The appearance of the flower is green-white to green-yellow. Flowering occurs in April and May. The fruit is a berry. Bees and flies are pollinators attracted to the flowers.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygmar2019.html'), 
  new Plant('Gray Dogwood', 'Cornus racemosa', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Cornales', 'Cornaceae Bercht. & J. Presl', 'Dogwood family', 'Cornus L.', 'Cornus racemosa Lam.', 'https://s7d1.scene7.com/is/image/isp/fygdec2021?qlt=100&wid=600&ts=1689691870059&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Gray dogwood grows in moist woods, upland woods, prairies and roadsides throughout the state. It is a shrub that may reach eight feet in height. Flowers are produced from May through July. The flowers are white and develop in clusters at the stem tips. The twigs are thin and gray. The fruits are spherical, fleshy and white and contain one or two seeds. Many species of pollinators are attracted to the flowers for pollen and nectar. Birds and small mammals feed on the fruits. The plant and its leaves are eaten by mammals and insects. Birds often nest in its branches.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygdec2021.html'), 
  new Plant('Great Angelica', 'Angelica atropurpurea', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Apiales', 'Apiaceae Lindl.', 'Carrot family', 'Angelica L.', 'Angelica atropurpurea L.', 'https://s7d1.scene7.com/is/image/isp/fygjan2021?qlt=100&wid=900&ts=1701882689675&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Great Angelica grows in the northern one-half of Illinois. It may be found in woodlands, calcareous fens, thickets and calcareous marshes. Flowers are produced from May through August. The flowers are white and appear in umbrella-shaped clusters. This plant\'s stem is dark purple. Great Angelica may reach four to five feet in height.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygjan2021.html'), 
  new Plant('Great Blue Lobelia', 'Lobelia siphilitica', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Campanulales', 'Campanulaceae Juss.', 'Bellflower family', 'Lobelia L.', 'Lobelia siphilitica L.', 'https://s7d1.scene7.com/is/image/isp/fygjun2016?qlt=100&wid=900&ts=1701120699409&$ImageComponent$&fit=constrain', null, 'Perennial', 'Great blue lobelia grows in wet areas throughout Illinois. It blooms from July through October, producing spikes of blue-to-purple flowers on a stalk from the top of the plant. The flowers have two upper lobes and three lower lobes. The lower lobes have stripes of white. This plant grows one to three feet in height. This member of the bluebell family has leaves arranged alternately along the stem. The leaf margin is toothed. Usually only one stem is present.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygjun2016.html'), 
  new Plant('Green Dragon', 'Arisaema dracontium', 'Magnoliophyta', 'Liliopsida', 'Arecidae', 'Arales', 'Araceae Juss.', 'Arum family', 'Arisaema Mart.', 'Arisaema dracontium (L.) Schott', 'https://s7d1.scene7.com/is/image/isp/fygjun2009?qlt=100&wid=600&ts=1700587384599&$ImageComponent$&fit=constrain', null, 'Perennial', 'Green dragon is in the arum or calla family and is related to Jack-in-the-pulpit. Found statewide, it grows in bottomland forests and blooms from May through June. A large green, pointed spathe, or floral leaf, partially surrounds the spadix, where the plant\'s flowers are clustered. In this plant, the spadix is much longer than the spathe. The leaf is very large and divided into five to 15 leaflets. The leaflets are held horizontally. Fertilized flowers produce green berries that turn bright red-orange in late summer. The plant may reach from one to four feet tall at maturity.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygjun2009.html'), 
  new Plant('Hairy White Aster', 'Symphyotrichum pilosum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum pilosum (Willd.) G.L. Nesom', 'https://s7d1.scene7.com/is/image/isp/fygsep2022?qlt=100&wid=600&ts=1689612226693&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Also known as frost aster, the hairy white aster grows statewide in open areas such as fields, roadsides and pastures as well as in woodlands. It may reach a height of about three and one-half feet. Stems, especially those in the upper parts of the plant, have small hairs. This species blooms from August through November. Clusters of flower heads are produced at the stem tips. There are 15-35 white, ray flowers around a central section of yellow, disk flowers per flower head. The fruit is an achene, a simple dry fruit that does not open at maturity. The achenes have a tuft of white hairs. Many species of pollinators visit the flowers.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygsep2022.html'), 
  new Plant('Hazelnut', 'Corylus americana', 'Magnoliophyta', 'Magnoliopsida', 'Hamamelididae', 'Fagales', 'Betulaceae Gray', 'Birch family', 'Corylus L.', 'Corylus americana Walter', 'https://s7d1.scene7.com/is/image/isp/fygoct2013?qlt=100&wid=900&ts=1673475407855&$ImageComponent$&fit=constrain', 'Photo © Illinois Department of Natural Resources, Image by Guy Sternberg', 'Perennial', 'Hazelnut is a shrub that grows in dry woodlands, forest edges, thickets and prairies throughout Illinois. It attains a height of three to 10 feet. Its leaves are simple and arranged alternately on the stem. This plant blooms from March through April. The flowers appear before the leaves in spring. The reproductive structures are in male and female catkins and do not have petals. The fruits produced are nuts that are up to 1.5 inches long and are eaten by people as well as wildlife.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygoct2013.html'), 
  new Plant('Heath Aster', 'Symphyotrichum ericoides', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum ericoides (L.) G.L. Nesom', 'https://s7d1.scene7.com/is/image/isp/fygfeb2021?qlt=100&wid=900&ts=1689613953156&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Heath aster grows in prairies, pastures and old fields throughout the state. Its leaves are short, thin (less than one-fourth inch wide) and numerous. Flowers are produced from July through October. These white flowers are packed in clusters at the tip of the stems. The flowers sometimes have a pink tinge. This species may grow from one to three feet tall.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygfeb2021.html'), 
  new Plant('Hoary Puccoon', 'Lithospermum canescens', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Boraginaceae Juss.', 'Borage family', 'Lithospermum L.', 'Lithospermum canescens (Michx.) Lehm. ', 'https://s7d1.scene7.com/is/image/isp/fygjul2012?qlt=100&wid=900&ts=1689790789900&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd.', 'Perennial', 'Hoary puccoon is a member of the Forget-Me-Not Family of plants, noted for their one-sided coil of flowers that unrolls and expands as the plant grows. Flowers develop in a cluster at the stem tip with each flower about one-half inch in diameter. Each flower has five flat lobes that extend from a tube. The flowers are orange or yellow and blooming occurs in late spring and early summer. The dark green leaves are arranged alternately on the stem. The plant may grow to 20 inches tall. Hoary puccoon grows in dry soil, including dry prairies, along roads and in open woods. It grows well in rocky soil.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygjul2012.html'), 
  new Plant('Hoary Vervain', 'Verbena stricta', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Verbenaceae J. St.-Hil.', 'Verbena family', 'Verbena L.', 'Verbena stricta Vent.', 'https://s7d1.scene7.com/is/image/isp/fygnov2015?qlt=100&wid=600&ts=1673475562716&$ImageComponent$&fit=constrain', 'Photo © Lance Merry', 'Perennial', 'Hoary vervain grows in prairies, fields and other open areas statewide. The leaves and stem are covered with white, hairlike structures. Leaves are toothed, oval and arranged in pairs along the stem. Flowers (about one-fourth inch wide) are produced from May through September. The flowers are light red-purple or rose pink and are produced on spikes at the top of the plant. This plant may grow from one to four feet tall.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygnov2015.html'), 
  new Plant('Horsemint','Monarda punctata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Lamiaceae Martinov', 'Mint family', 'Monarda L.', 'Monarda punctata L.', 'https://s7d1.scene7.com/is/image/isp/fygfeb2018?qlt=100&wid=900&ts=1701197112340&$ImageComponent$&fit=constrain', null, ['Perennial', 'Biennial', 'Annual'], 'Horsemint may be found in the northern one‐half of Illinois. It grows in sand prairies, hill prairies and on dunes. This species may be a perennial, biennial or annual plant. Its four‐sided stem is hairy. Its leaves are arranged opposite each other on the stem. These simple, toothed leaves are lance‐shaped. Flowers are produced from June through October. The yellow flowers have purple spots. Flowers are clustered in the upper leaf axils. The bracts at the base of the flower are white or purple. The fruit is a nut. Horsemint may attain a height of one to three feet. This plant provides pollen and nectar to pollinators.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygfeb2018.html'), 
  new Plant('Horsetail Milkweed', 'Asclepias verticillata', 'Magnoliophyta','Magnoliopsida', 'Asteridae', 'Gentianales', 'Asclepiadaceae Borkh.', 'Milkweed family', 'Asclepias L.', 'Asclepias verticillata L.', 'https://s7d1.scene7.com/is/image/isp/fygoct2014?qlt=100&wid=900&ts=1689612533257&$ImageComponent$&fit=constrain', null, 'Perennial', 'Horsetail milkweed grows naturally in prairies, fields and rocky woods in Illinois. It can be found throughout the state. These plants are fairly short, usually less than 24 inches tall. Leaves are very thin and no longer than three inches in length. The flowers are white and appear in clusters at the stem tip. Flowering occurs from May through September. Flowers have an hourglass shape. The fruits are narrow pods, about three inches long.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygoct2014.html'), 
  new Plant('Illinois Mimosa', 'Desmanthus illinoensis','Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Desmanthus Willd.', 'Desmanthus illinoensis (Michx.) MacMill. ex B.L. Rob. & Fernald', ['https://s7d1.scene7.com/is/image/isp/bnilmamosa?qlt=100&wid=600&ts=1689613663766&$ImageComponent$&fit=constrain', 'https://s7d1.scene7.com/is/image/isp/bnilmimosaseeds?qlt=100&wid=600&ts=1689614004978&$ImageComponent$&fit=constrain'], null, 'Perennial', 'Illinois mimosa, also known as bundle-flower, can be found in all of Illinois except the northwestern one-fourth of the state. It grows along roads and railroad tracks, in prairies, on levees and in other moist areas. The plant can attain a height of up to three feet. The leaves are compound and delicate. Clusters of the tiny flowers are produced on stalks from the leaf axils. Flowers are white. They are produced from June through August. Curved, brown seedpods are noticeable in late summer and fall. This plant is an important food source for grazing animals of the prairie and supplies pollen and nectar to pollinator species.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygoct2016.html'), 
  new Plant('Indiangrass', 'Sorghastrum nutans', 'Magnoliophyta', 'Liliopsida', 'Commelinidae',' Cyperales', 'Poaceae Barnhart', 'Grass family', 'Sorghastrum Nash', 'Sorghastrum nutans (L.) Nash', 'https://s7d1.scene7.com/is/image/isp/bnindiangrass?qlt=100&wid=600&ts=1689602602051&$ImageComponent$&fit=constrain', null, 'Perennial', 'You may not consider winter as a time to think about or be impressed by the plants in your garden. Winter gardens can be beautiful, though, and provide important habitat for wildlife. As you plan for your garden this year, consider including some native grasses. Leaving them year round can be a pleasing experience for you, and they require very little maintenance. Native prairie grasses are resistant to cold and drought and are rarely attacked by disease and insects. They are perennials that you can enjoy year after year.Indian grass grows to a height of four to six feet. It has long narrow leaves that ripple in the wind and seed heads that look like feather plumes. Flowers develop in August and September, and the plant provides a good color accent in fall.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygjan2008.html'), 
  new Plant('Inland Oats', 'Chasmanthium latifolium', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Chasmanthium Link', 'Chasmanthium latifolium (Michx.) Yates ', 'https://s7d1.scene7.com/is/image/isp/bninlandoats?qlt=100&wid=900&ts=1689689720846&$ImageComponent$&fit=constrain', null, 'Perennial', 'Inland oats plants grow naturally in Illinois in areas of moist soil, preferably shaded. They are more commonly found in the southern half of the state than in northern Illinois. This native grass flowers from July through October. The plants may reach four feet in height. Their seed heads are attractive and provide food for wildlife. Seed heads turn a golden color in autumn. This species works well in woodland plantings and along woodland edges, although it will grow in full sun as well.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygaug2013.html'), 
  new Plant('Jack in the Pulpit', 'Arisaema triphyllum', 'Magnoliophyta', 'Liliopsida', 'Arecidae', 'Arales', 'Araceae Juss.', 'Arum family', 'Arisaema Mart.', 'Arisaema triphyllum (L.) Schott', 'https://s7d1.scene7.com/is/image/isp/fygmar2010?qlt=100&wid=600&ts=1689603398258&$ImageComponent$&fit=constrain', 'Photo © 2009, River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Jack-in-the-pulpit can be found in every Illinois county. It grows in woodlands that are rich in nutrients. Two leaves are usually present. Each leaf has three parts, and the leaf is borne on a long stalk. Tiny flowers develop at the bottom of a club-shaped structure known as the spadix. The spadix is covered by a leaflike structure, the spathe, which in this plant has a flap similar to a hood at the top. The spathe is green or brown purple and may be striped. The plant grows to a height of about one to two feet. Fruit develop as a cluster of berries that are bright red when mature. The common name for this plant derives from the rigid spadix (“Jack” or preacher) covered by the spathe (his canopied pulpit).', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygmar2010.html'), 
  new Plant('Jacob\'s-ladder', 'Polemonium reptans', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Solanales', 'Polemoniaceae Juss.', 'Phlox family', 'Polemonium L.', 'Polemonium reptans L. ', 'https://s7d1.scene7.com/is/image/isp/fygapr2010?qlt=100&wid=900&ts=1689602003226&$ImageComponent$&fit=constrain', 'Photo © 2009, River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Jacob’s-ladder grows throughout Illinois, mainly in prairies and woodlands. Its smooth stems are upright or spreading and may grow to nearly one foot tall. The plant has pinnately compound leaves, with from three to 13 leaflets. Flowering occurs from April through June. The flowers are pale blue and have five petals. Flowers are clustered at the tip of a stem. The fruit is a capsule that usually contains three seeds.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygapr2010.html'), 
  new Plant('Jerusalem Artichoke', 'Helianthus tuberosus', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Helianthus L.', 'Helianthus tuberosus L.', 'https://s7d1.scene7.com/is/image/isp/fygjun2022?qlt=100&wid=900&ts=1689602485213&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Jerusalem artichoke grows in moist soil, prairies and disturbed soil statewide. Its leaves are broad, and the stems are hairy (white hairs). The upper leaves are alternately arranged on the stem, but the lower leaves may be opposite each other. A single plant may reach six or more feet in height. Flowers are produced from August through October. The flower heads are stalked at the tip of the stem branches. The flowers (both disk and ray) are yellow. The fruit is an achene, a simple dry fruit that does not open at maturity. Several bee species act as pollinators as they collect nectar and pollen from the flowers.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygjun2022.html'), 
  new Plant('June Grass', 'Koeleria macrantha', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Koeleria Pers.', 'Koeleria macrantha (Ledeb.) Schult.', ['https://s7d1.scene7.com/is/image/isp/fygmay2022a?qlt=100&wid=600&ts=1689600767412&$ImageComponent$&fit=constrain', 'https://s7d1.scene7.com/is/image/isp/fygmay2022b?qlt=100&wid=600&ts=1689600310255&$ImageComponent$&fit=constrain'], 'Photos © John Hilty', 'June grass is also known as crested hair grass. This perennial plant has leaves that tend to twist or spiral as they grow. The leaves may be eight inches long and less than one‐fourth inch wide. The small spikes of flowers are densely crowded in narrow heads, about four to five inches in length. Each spikelet has two to four flowers. The fruit is a grain. June grass is a mid‐height grass, about two feet tall, that may be found throughout Illinois. It grows in dry to moist prairies and sandy woods. Flowering occurs from June through September. Wind is the main agent of pollination.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygmay2022.html'), 
  new Plant('Large White Trillium', 'Trillium grandiflorum', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Trillium L.', 'Trillium grandiflorum (Michx.) Salisb.', 'https://s7d1.scene7.com/is/image/isp/fygdec2014?qlt=100&wid=600&ts=1689617397517&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Large white trillium grows mainly in the northern half of Illinois although it can be found occasionally in the southern half of the state. It thrives in rich woodlands. Like all trilliums, this member of the lily family has three leaves, three petals and three sepals. The white petals turn pink as they age. The plant develops from a bulb. Flowering occurs in April and May. Large white trillium typically reaches one to one and one-half feet in height.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygdec2014.html'), 
  new Plant('Small Yellow Lady\'s slipper orchid', 'Cypripedium parviflorum', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Orchidales', 'Orchidaceae Juss.', 'Orchid family', 'Cypripedium L.', 'Cypripedium parviflorum Salisb.', 'https://s7d1.scene7.com/is/image/isp/fygmar2013?qlt=100&wid=900&ts=1689611997200&$ImageComponent$&fit=constrain', null, 'Perennial', 'The small yellow lady\'s-slipper orchid grows in woodlands throughout the state, but it is not common in any part of the state. It prefers moist soil and shaded areas. The large yellow flowers appear in April and May. One or two flowers per plant are produced at the top of a stalk. The plant may grow to 12 to 24 inches in height. The leaves may be up to six inches long and three inches wide. The leaf base clasps the stem. Three to five leaves are usually present.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygmar2013.html'), 
  new Plant('Late Boneset', 'Eupatorium serotinum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Eupatorium L.', 'Eupatorium serotinum Michx.', null, null, 'Perennial', 'Late boneset, also known as late-flowering thoroughwort, can be found throughout Illinois in pastures, along roads and in woodlands. It flowers from July through October, making it an important nectar source for pollinators late in the year. The flowers are white and develop in small, branched clusters at the stem tip. The leaves are mostly paired along the stem. The plant reaches a height of about four feet.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygnov2017.html'), 
  new Plant('Leadplant', 'Amorpha canescens', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Amorpha L.', 'Amorpha canescens Pursh', 'https://s7d1.scene7.com/is/image/isp/bnleadplant?qlt=100&wid=900&ts=1689693222812&$ImageComponent$&fit=constrain', null, 'Perennial', 'Leadplant is a species that is commonly found in prairies in the northern two-thirds of the state. It does grow throughout Illinois, however. Its leaves are arranged alternately along the stem, and each contains from 21 to 51 leaflets. It blooms from May through August. The flowers are dark purple and are produced in a spike at the stem tip. They attract many pollinators. The fruit is a pod. Leadplant grows from one to three feet in height. The name “leadplant” was given to it due to the gray-green color of its leaves.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygaug2010.html'), 
  new Plant('Little Bluestem', 'Schizachyrium scoparium', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Schizachyrium Nees', 'Schizachyrium scoparium (Michx.) Nash', 'https://s7d1.scene7.com/is/image/isp/bnlittlebluestem?qlt=100&wid=600&ts=1689619221476&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Little bluestem is a prairie bunch grass. Its “bluestem” name comes from the blue-green color of the leaves and flower stalks in spring and summer. After a frost, however, the stems turn an attractive orange-brown shade that persists throughout the winter, making a nice contrast to snow. It can brighten any gray, winter day. Little bluestem blooms in August and September. The white flowers form in a cluster at the tip of each side stalk. The seeds are small and have feathery white projections. This plant may grow to a height of four feet. It is native to dry prairies in the state.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygfeb2009.html'), 
  new Plant('Marsh Buttercup', 'Ranunculus septentrionalis', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Ranunculus L.', 'R. septentrionalis', 'https://s7d1.scene7.com/is/image/isp/fygsep2021?qlt=100&wid=900&ts=1689691384530&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Marsh buttercup grows in bottomland woods, wet ditches and swampy areas throughout Illinois. Its stems are often horizontal instead of upright. The plant may reach one to three feet tall. Its leaves have three segments, each of which is toothed and lobed. Flowers are produced from April through July and again from September through October. The flowers are yellow with five petals. The petals have a waxy appearance. The fruits are small, hard and dry.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygsep2021.html'), 
  new Plant('Marsh Marigold', 'Caltha palustris', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Caltha L.', 'Caltha palustris L.', 'https://s7d1.scene7.com/is/image/isp/fygapr2011?qlt=100&wid=900&ts=1700667876220&$ImageComponent$&fit=constrain', null, 'Perennial', 'Marsh marigold grows naturally in the northern two-thirds of Illinois, particularly in wet areas and moist woodlands. Its large yellow flowers are among the earliest wildflower blossoms opening in spring. It blooms from April through June. The dark green leaves are shiny and provide a nice contrast to the yellow blooms. This member of the buttercup family has large, hollow stems. The plant may reach two feet in height. It completes its life cycle by mid-summer and will retain leaves longer if it is grown in moist soil. It provides a nice addition to a woodland garden, aquatic or wetland garden or a moist soil border to a garden.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygapr2011.html'), 
  new Plant('Mayapple', 'Podophyllum peltatum', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Berberidaceae Juss.', 'Barberry family', 'Podophyllum L.', 'Podophyllum peltatum L.', 'https://s7d1.scene7.com/is/image/isp/fygapr2013?qlt=100&wid=900&ts=1689611645617&$ImageComponent$&fit=constrain', null, 'Perennial', 'The mayapple, or mandrake, is a very common plant found in woodlands statewide. It develops from an underground stem. The plant may grow to two feet in height and has two umbrellalike leaves, each with five to nine lobes. A single leaf may be 14 inches wide. The leaves attach to the stalk from their bottom center. Flowering occurs from April through June. One white flower develops where the leaf stalks join at the main stem. The flower has six to nine petals, and only lasts a day or two. The fruit is an ovoid, yellow berry that may be two inches long. The fruit ripens in August.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygapr2013.html'), 
  new Plant('Meadow Anemone', 'Anemone canadensis', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Anemone L.', 'Anemone canadensis L.', 'https://s7d1.scene7.com/is/image/isp/bnmeadowanemone?qlt=100&wid=900&ts=1700672788132&$ImageComponent$&fit=constrain', null, 'Perennial', 'Meadow anemone grows in woodlands and moist prairies in the northern two-thirds of Illinois and in scattered locations in southern Illinois. Its flowers are produced from May through July. Flowers are produced singly on a long stalk. The five white "petals" are actually sepals. The three-part leaves are not stalked. There are two leaves, and they surround the stem at their base. This plant, a member of the buttercup family, may grow to a height of one to two feet.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygapr2012.html'), 
  new Plant('Missouri Ironweed', 'Vernonia missurica', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asteralis', ' Asteraceae Bercht. & J. Presl', 'Aster family', 'Veronia', 'V. missurica', 'https://s7d1.scene7.com/is/image/isp/bnmissouriironweed?qlt=100&wid=900&ts=1700675002513&$ImageComponent$&fit=constrain', null, 'Perennial', 'Ironweed is a common plant in Illinois, growing in open woods, prairies and roadsides. The plant may grow to five feet tall. Stems are unbranched except immediately below the flower heads. The leaves are arranged alternately along the stem and are toothed along the edges. The underside of each leaf is finely pitted. The purple flowers are produced in clusters at the top of the plant from July though September.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygnov2012.html'), 
  new Plant('New England Aster', 'Symphyotrichum novae-angliae', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum novae-angliae (L.) G.L. Nesom', 'https://s7d1.scene7.com/is/image/isp/bnneaster?qlt=100&wid=900&ts=1689882024302&$ImageComponent$&fit=constrain', null, 'Perennial', 'The abundant purple, lavender or pink flowers of New England aster are produced from August until heavy frosts occur. Each flower has a yellow or orange center. Flowers are about one and a half inches wide. Found throughout Illinois in prairies and pastures, the mature New England aster plant has a bushy appearance as stems grow in all directions from the root. Leaves are from one to two inches long and do not have stems. Butterflies are very attracted to the huge number of flowers produced by this species.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygoct2008.html'), 
  new Plant('New Jersey Tea', 'Ceanothus americanus', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum novae-angliae (L.) G.L. Nesom ', 'https://s7d1.scene7.com/is/image/isp/fygjan2018?qlt=100&wid=600&ts=1689611532126&$ImageComponent$&fit=constrain', 'Photo © 2004, Peter M. Dziuk', 'Perennial', 'New Jersey tea, also known as wild snowball, may be found statewide in Illinois. It grows in dry, open woods, on rocky slopes and in moist to dry prairie edges. This perennial shrub can grow to a height of about three feet. Its leaves are arranged alternately along the stem. Leaves are usually hairy on the lower surface. Flowers are produced from June through August. These white flowers develop in clusters at the stem tip. Insects are the main pollinators while the seeds are dispersed from the explosive action of ripe fruit. The leaves and fruit of this plant are used for food by wildlife.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygjan2018.html'), 
  new Plant('Nodding Onion', 'Allium cernuum', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Allium L.', 'Allium cernuum Roth', 'https://s7d1.scene7.com/is/image/isp/fygdec2017?qlt=100&wid=900&ts=1689612394383&$ImageComponent$&fit=constrain', 'Photo © 2002, Peter M. Dziuk, www.minnesotawildflowers.info', 'Perennial', 'Nodding onion grows in northeastern Illinois in wooded areas and slopes that are moist. It prefers rocky, sandy or black soil substrates. A plant may reach one to one and one-half feet tall. Leaves and stems arise from an underground bulb. These basal leaves are long and narrow. The stems are leafless. Flowers are produced from July through September. The top of the flower stem is bent downward, and the flowers droop or nod toward the ground. Flower color may be pink, lavender or white. The flowers support a variety of bee pollinator species.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygdec2017.html'), 
  new Plant('Nodding Wild Rye', 'Elymus canadensis', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Elymus L.', 'Elymus canadensis L.', 'https://s7d1.scene7.com/is/image/isp/fygjan2020?qlt=100&wid=600&ts=1689604085434&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Nodding wild rye is a perennial herb. Its smooth, upright stems grow to six feet tall. Its leaves are long and may be one inch wide. Flowers are arranged in dense spikes that are usually curved or nodding down when mature. Nodding wild rye grows in many habitats, including beaches, roadsides, dry prairies and woods. This plant flowers from June through September. It provides food for several animal species.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygjan2020.html'), 
  new Plant('Ox-eye Sunflower', 'Heliopsis helianthoides', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Heliopsis Pers.', 'Heliopsis helianthoides (L.) Sweet', 'https://s7d1.scene7.com/is/image/isp/bnoxeye?qlt=100&wid=900&ts=1701194394490&$ImageComponent$&fit=constrain', null, 'Perennial', 'Although named ox-eye “sunflower,” this perennial herb is not a true sunflower. It is a member of the aster family, though, along with the true sunflowers. Ox-eye sunflower grows statewide in thickets, open woods and prairies. The plant has short, arrowhead‐shaped, toothed leaves arranged in pairs on the smooth stem. Some of these plants have smooth leaves while others have rough leaves. Flowers are produced from June through October. A single flower head is produced at the stem tip. Both yellow ray flowers and disk flowers are present in the flower head. Ox-eye sunflower may attain a height of two to five feet. Its flat flower heads attract many pollinators.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygmay2017.html'), 
  new Plant('Pale Coneflower', 'Echinacea pallida', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Echinacea Moench', 'Echinacea pallida (Nutt.) Nutt.', 'https://s7d1.scene7.com/is/image/isp/bnpaleconeflower?qlt=100&wid=900&ts=1689687183352&$ImageComponent$&fit=constrain', null, 'Perennial', 'Pale coneflower grows in dry prairies and open woodlands throughout Illinois. It may reach two to four feet tall. There are bristly hairlike structures on the stems and leaves. Leaves may be up to 10 inches long and one and one-half inches wide. Its lower leaves are lance-shaped with parallel venation and smooth edges, a feature that helps to distinguish this plant from purple coneflower (Echinacea purpurea). The lower leaves are also stalked, while the stem leaves usually do not have a stalk and are arranged alternately. Flowers are produced from May through August. The ray flowers are pale, pink-purple and droop when mature. There is one flower head per stem. This plant is attractive to many species of pollinators.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygaug2015.html'), 
  new Plant('Partridge Pea', 'Chamaechrista fasciculata', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Chamaecrista (L.) Moench', 'Chamaecrista fasciculata (Michx.) Greene', 'https://s7d1.scene7.com/is/image/isp/bnpartridgepea?qlt=100&wid=900&ts=1701104541616&$ImageComponent$&fit=constrain', null, 'Annual', 'Partridge pea grows statewide in fields, prairies and open areas. Flowering occurs from June through October. Unlike most native prairie wildflowers, it is an annual, arising from seeds each year. A plant may reach two feet in height. The leaves are arranged alternately on the stem. These compound leaves have 20 to 30 leaflets. The leaves are sensitive to touch and may close or wilt when touched. The flowers are yellow and arise from thin stalks. Two to four flowers are found per leaf axil. The fruit is a narrow, flat hairy pod. These plants are good for wildlife. Bees are attracted to the flowers, birds eat the seeds and the foliage provides shelter for small animals.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygfeb2015.html'), 
  new Plant('Persimmon', 'Diospyros virginiana', 'Magnoliophyta', 'Magnoliopsida', 'Dilleniidae', 'Ebenales', 'Ebenaceae', 'Persimmon family', 'Diospyros', 'Diospyros virginiana', 'https://s7d1.scene7.com/is/image/isp/fygnov2010?qlt=100&wid=900&ts=1686598946177&$ImageComponent$&fit=constrain', 'Photo © Illinois Department of Natural Resources, Guy Sternberg, Photographer', 'Perennial', 'A persimmon tree may grow to about 50 feet in height. Its bark is dark gray or black and divided into square-shaped blocks. Its leaves are arranged alternately on the stem. Each leaf is simple and smooth along the edges. The leaf is oval or elliptical in shape with a pointed tip. A leaf may be up to five inches long and two and one-half inches wide. The upper leaf surface is dark green and shiny, while the lower surface is lighter in color. Male and female flowers are usually produced on separate trees. The fruit is a fleshy sphere that is usually orange when ripe. Many animals eat persimmon fruits. Persimmon trees grow well in a variety of conditions from well-drained uplands to wet bottomland soil.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygnov2010.html'), 
  new Plant('Pickerelweed', 'Pontederia cordata', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Pontederiaceae Kunth', 'Water-Hyacinth family', 'Pontederia L.', 'Pontederia cordata L.', 'https://s7d1.scene7.com/is/image/isp/fygdec2015?qlt=100&wid=600&ts=1689702569693&$ImageComponent$&fit=constrain', 'Photo © Lance Merry', 'Perennial', 'Pickerelweed grows in muddy, wet areas and shallow water throughout the state except the east central counties. The leaves are dark green, shaped somewhat like an arrowhead and, if growing in water, emerge from the water. Flowers are produced from May through September. The flowers are dark blue to purple and clustered in a spike at the tip of a stalk. This plant may grow from one to four feet tall.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygdec2015.html'), 
  new Plant('Pin Oak', 'Quercus palustris', 'Magnoliophyta', 'Magnoliopsida', 'Hamamelididae', 'Fagales', 'Fagaceae Dumort.', 'Beech family', 'Quercus L.', 'Quercus palustris Münchh.', 'https://s7d1.scene7.com/is/image/isp/fygnov2013?qlt=100&wid=600&ts=1673475739155&$ImageComponent$&fit=constrain', 'Photo © Illinois Department of Natural Resources, Image by Guy Sternberg', 'Perennial', 'The pin oak tree may grow to a height of 75 feet. Its lower branches droop. The bark is light or dark brown with little furrowing. The leaves are simple, up to seven inches long and divided more than one-half way to the middle into five to seven lobes, each tipped with a bristle. Leaves are arranged alternately along the branch. Male flowers are located on slender, drooping spikes. Female flowers are in clusters. The flowers are small, with male and female flowers separate but on the same tree. The pale-brown acorns grow in clusters of one to four and are up to one-half inch wide. The acorn cap encloses less than one-fourth of the acorn. The pin oak grows in floodplain woods, along streams, at the edges of swamps and near ponds. This tree flowers from April through May. Its acorns are a good source of food for many species of wildlife.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygnov2013.html'), 
  new Plant('Poke Milkweed', 'Asclepias exaltata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Gentianales', 'Asclepiadaceae Borkh.', 'Milkweed family', 'Asclepias L.', 'Asclepias exaltata L.', 'https://s7d1.scene7.com/is/image/isp/fygjul2011?qlt=100&wid=600&ts=1689613979669&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Poke milkweed grows in woodland edges throughout Illinois, although it is not common in any part of the state. Growing to a height of from three to six feet, the plant has stalked leaves in pairs along the stem. As with all milkweeds, the sap is milky white, and the five petals of each flower point back to the flower stalk while supporting a five-parted central cup. Flowers in this species are white and may have some purple or green showing. Flowers are produced in June and July. Flower clusters arise on a stalk from the base of the leaf and droop toward the ground. The fruit is a pod that contains seeds attached to silky strands that aid in dispersal by the wind.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygjul2011.html'), 
  new Plant('Prairie Avens', 'Geum triflorum', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Rosales', 'Rosaceae Juss.', 'Rose family', 'Geum L.', 'Geum triflorum Pursh', 'https://s7d1.scene7.com/is/image/isp/fygfeb2014?qlt=100&wid=600&ts=1689602803469&$ImageComponent$&fit=constrain', 'Photo © 2014, River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Prairie avens, also known as prairie smoke, grows naturally in the northern one-sixth of Illinois in dry prairies. This plant of the rose family blooms in May and June. Each stem has three to six drooping flowers that are individually stalked. The flower has five red-purple sepals alternating with thin bracts. The five, small petals are white to purple-pink in color. The name "prairie smoke" derives from the long, wispy plumes on the seed pods, giving the plant a smoky look. The plant rarely grows more than one foot tall.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygfeb2014.html'), 
  new Plant('Prairie Blazing Star', 'Liatris pycnostachya', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Liatris Gaertn. ex Schreb.', 'Liatris pycnostachya Michx.', 'https://s7d1.scene7.com/is/image/isp/bnprairiebstar?qlt=100&wid=900&ts=1701198252526&$ImageComponent$&fit=constrain', null, 'Perennial', 'Prairie blazing-star is found statewide in prairies and some fens. A single plant may attain a height of up to 48 inches. This member of the aster family has unbranched, hairy stems and leaves that are shaped much like a blade of grass. Blue-purple to red-pink flower heads are produced from September through October. The flower heads are in a spike at the top of the plant and attach directly to the stem. Bracts below the flower heads are pointed, long and the tip of each bends away from the stem. Pollinators are attracted to the nectar and pollen from this species.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygjun2018.html'), 
  new Plant('Prairie Cinquefoil', 'Drymocallis arguta', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Rosales', 'Rosaceae Juss.', 'Rose family', 'Drymocallis', 'Drymocallis arguta', 'https://s7d1.scene7.com/is/image/isp/bnprairiecin?qlt=100&wid=900&ts=1701198503676&$ImageComponent$&fit=constrain', null, 'Perennial', 'Prairie cinquefoil is found in prairies in the northern half of Illinois and in Shelby County. A single plant may attain a height of up to 36 inches. This member of the rose family has hairy stems and white flowers. Stems do not branch below the flower clusters. The flowers are produced from June through July. The compound leaves have three to 11 leaflets. Leaflets are hairy on the bottom.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygjul2018.html'), 
  new Plant('Prarie Coreopsis', 'Coreopsis palmata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae','Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Coreopsis L.', 'Coreopsis palmata Nutt.', 'https://s7d1.scene7.com/is/image/isp/bnprairiecoreopsis?qlt=100&wid=900&ts=1701195003241&$ImageComponent$&fit=constrain', null, 'Perennial', 'Prairie coreopsis grows statewide in Illinois, although it is more common the northern three-fourths of the state. It thrives in prairies, open woods and savannas. It may reach a maximum height of about two and one-half feet. Leaves are stiff and have three lobes. The yellow flower heads (disk and ray flowers) are produced from June through August. There are approximately eight rays per flower. Many pollinators are attracted to the nectar and pollen in the flower heads.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygjul2017.html'), 
  new Plant('Prairie Dock', 'Silphium terebinthinaceum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Silphium L.', 'Silphium terebinthinaceum Jacq.', 'https://s7d1.scene7.com/is/image/isp/fygoct2010a?qlt=100&wid=600&ts=1689693081587&$ImageComponent$&fit=constrain', null, 'Perennial', 'Prairie dock’s large oval or heart-shaped leaves develop only at the base of the plant. The leaves are toothed along the edge and may be two feet long and eight inches wide. The small yellow flower heads develop at the tip of a long stalk. The flower stalk may grow from six to 10 feet tall. Prairie dock grows in moist prairies throughout the state. It produces flowers from July through September. The leaves persist when dry and add interest to the garden through fall and winter.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygoct2010.html'), 
  new Plant('Prairie Dropseed', 'Sporobolus heterolepis', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Sporobolus R. Br.', 'Sporobolus heterolepis (A. Gray) A. Gray', 'https://s7d1.scene7.com/is/image/isp/bnprairiedropseed?qlt=100&wid=900&ts=1700590817039&$ImageComponent$&fit=constrain', null, 'Perennial', 'Prairie dropseed is a native grass that can be found throughout Illinois , although it more commonly grows in the northern half of the state than in southern Illinois. It grows in mesic prairies, those that have good drainage but remain moist during most of the year, and also in hill prairies and other dry areas. This bunch grass grows in a cluster and is sometimes described as looking like a “fountain of grass” as the long, thin leaves arch gracefully to the ground from the central portion of the plant. Leaves may be 20 inches long and are about one-eighth inch wide. The plant can be two to three feet tall. It blooms in August and September. The flowers are on individual stalks in a cluster at the top of the flowering stems. Prairie dropseed turns orange-brown in autumn, and its leaves and flowering stalks persist in winter.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygjan2010.html'), 
  new Plant('Prairie Indian Plantain', 'Arnoglossum plantagineum','Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Arnoglossum Raf.', 'Arnoglossum plantagineum Raf.', 'https://s7d1.scene7.com/is/image/isp/fygjan2014?qlt=100&wid=900&ts=1701101031858&$ImageComponent$&fit=constrain', null, 'Perennial', 'Prairie Indian plantain grows throughout Illinois in wet prairies and near marshes and bogs. This plant of the daisy family produces flowers in flat-topped clusters at the tip of the stems. Flowers are white and appear from June through August. Leaves may be eight inches long and four inches wide. The leaves are oval and show several large, parallel veins. The plant can grow from two to four feet tall.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygjan2014.html'), 
  new Plant('Prairie Milkweed', 'Asclepias sullivantii', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Gentianales', 'Asclepiadaceae Borkh.', 'Milkweed family', 'Asclepias L.', 'Asclepias sullivantii Engelm. ex A. Gray', 'https://s7d1.scene7.com/is/image/isp/bnpmilkweed?qlt=100&wid=900&ts=1689689659027&$ImageComponent$&fit=constrain', null, 'Perennial', 'Prairie milkweed plants grow naturally in Illinois in moist prairies. It may be found statewide in Illinois but is much more common in the northern two-thirds of the state. The plants may reach from two to five feet in height. The leaves are oblong, thick and up to seven inches long and three and a half inches wide and with a pointed tip. Leaves are arranged opposite each other on the stem. Leaf veins often appear red. Leaves and stem are smooth, and the sap is milky. Flowers are produced in one to several clusters at the stem tip. The pink-red flowers have the typical hourglass shape of milkweed flowers. The seeds pods are attractive in fall.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygsep2014.html'), 
  new Plant('Purple Coneflower', 'Echinacea purpurea', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Echinacea Moench', 'Echinacea purpurea (L.) Moench', 'https://s7d1.scene7.com/is/image/isp/bnpurcone?qlt=100&wid=900&ts=1689688535419&$ImageComponent$&fit=constrain', null, 'Perennial', 'Purple coneflower is a species of prairies, open woods and wooded floodplains in Illinois. It blooms from July through September. The purple ray flowers surround the cluster of disk flowers. Each flower head forms on its own stalk. Its leaves are large, widest at the base, and arranged alternately along the stem. The leaves feel rough and are toothed along the edge. This plant may grow to a height of five feet.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygsep2010.html'), 
  new Plant('Purple Joe-pye-weed', 'Eutrochium purpureum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Eutrochium Raf.', 'Eutrochium purpureum (L.) E.E. Lamont', null, null, 'Perennial', 'Purple Joe-pye-weed grows in woodlands statewide. It blooms from June through October. Flowers are pale pink. They are produced in large clusters at the tip of the plant. Flowers appear to be fuzzy, and the clusters can be very large. The stem of this plant is usually green. Each stem is unbranched. The leaves are produced in whorls of three or four leaves, each on a short stalk. The plant may grow from two to six feet in height. Purple Joe-pye-weed is an important food source for native pollinators.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygsep2015.html'), 
  new Plant('Purple Milkweed', 'Asclepias purpurascens', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Gentianales', 'Asclepiadaceae Borkh.', 'Milkweed family', 'Asclepias L.', 'Asclepias purpurascens L.', 'https://s7d1.scene7.com/is/image/isp/fygnov2014?qlt=100&wid=900&ts=1689782096952&$ImageComponent$&fit=constrain', null, 'Perennial', 'Purple milkweed grows statewide in Illinois in prairies and along the edges of woods. Its maximum height is about three feet. Leaves are oval and arranged oppositely on the stem. The leaves are large and may be eight inches long and four inches wide. Flowers develop in spherical clusters at the top of the plant. Each flower has its own stalk. The flowers are red-purple with five reflexed petals and five hoods per flower. Flowering occurs from May through July. The fruits are smooth pods, up to six inches long and less than one inch wide.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygnov2014.html'), 
  new Plant('Purple Prairie Clover', 'Dalea purpurea', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Dalea L.', 'Dalea purpurea Vent.', 'https://s7d1.scene7.com/is/image/isp/bnppclover?qlt=100&wid=900&ts=1689883199611&$ImageComponent$&fit=constrain', null, 'Perennial', 'Purple prairie clover grows in prairies statewide. It blooms from June through September. The plant grows to one to two feet in height. Leaves are alternate and compound with three to five leaflets. Each leaflet is thin (about 1/8 inch) and up to about one inch long. The flowers are produced in a spike at the tip of the stem. Flowers may be purple, rose, pink or red. These plants are beneficial to the garden by adding nitrogen to the soil.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygsep2012.html'), 
  new Plant('Purple Sneezeweed', 'Helenium flexuosum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Helenium L.', 'Helenium flexuosum Raf.', 'https://s7d1.scene7.com/is/image/isp/fygoct2017?qlt=100&wid=900&ts=1689611965288&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Purple sneezeweed can be found commonly in southern Illinois. It is present in central and northern Illinois, but the occurrence decreases greatly in those areas. It grows in fields, ditches, wet prairies, pastures and other locations where the soil is moist and somewhat acidic. This member of the aster family may grow to three feet in height. Flower heads are produced at the stem tip from June through September. Each flower head has a brown-purple center of disk flowers surrounded by 8-14 yellow ray flowers. The flowers provide nectar and pollen to a variety of insects.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygoct2017.html'), 
  new Plant('Purple Spring Cress', 'Cardamine douglassii', 'Magnoliophyta', 'Magnoliopsida', 'Dilleniidae', 'Capparales', 'Brassicaceae Burnett', 'Mustard family', 'Cardamine L.', 'Cardamine douglassii Britton', 'https://s7d1.scene7.com/is/image/isp/fygmay2021?qlt=100&wid=900&ts=1689601903474&$ImageComponent$&fit=constrain', 'Photo © 2021, River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Purple spring cress grows in low woodlands in the northern two-thirds of Illinois plus Johnson County. Each basal leaf is on a long stalk, and the stem leaves are attached directly to the stem with no stalk. Flowers are produced in April and May. The flowers are in a cluster at the stem tip. Flowers are pink or purple. A single plant may be four to 12 inches tall.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygmay2021.html'), 
  new Plant('Purple Trillium', 'Trillium recurvatum', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Trillium L.', 'Trillium recurvatum Beck', 'https://s7d1.scene7.com/is/image/isp/fygapr2009?qlt=100&wid=900&ts=1673474778441&$ImageComponent$&fit=constrain', null, 'Perennial', 'The purple trillium is also known as the purple wake robin. Found statewide in rich woodland soil, it grows from thick roots. Its upright, unbranched stem may be one and one-half feet tall. Three leaves are present in a whorl under the flower. Leaves are mottled and up to four inches long. A single flower blooms at the stem tip. The flower has three maroon petals, each up to one and one-half inches long. The fruit is an ovoid, six-angled dry berry, about three-fourths inch long. Purple trillium blooms in Illinois from late March through late May.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygapr2009.html'), 
  new Plant('Pussy-toes', 'Antennaria plantaginifolia', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Antennaria Gaertn.', 'Antennaria plantaginifolia (L.) Richardson', 'https://s7d1.scene7.com/is/image/isp/fygmay2019?qlt=100&wid=900&ts=1689691970074&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Pussy-toes plants grow in woodlands, hill prairies, bluffs, thickets, pastures and old fields statewide. The plant may reach about six inches in height. There is a rosette of leaves at the base of the plant, and some leaves also develop along the flower stem. Plants are either male or female. Flowers develop in April and May. The flowers are cream or white. The fruit is a nutlet with a tuft of white hair. Pollinating insects visit the flowers, and some birds eat the seeds.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygmay2019.html'), 
  new Plant('Rattlesnake Master', 'Eryngium yuccifolium', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Apiales', 'Apiaceae Lindl.', 'Carrot family', 'Eryngium L.', 'Eryngium yuccifolium Michx.', 'https://s7d1.scene7.com/is/image/isp/bnratmaster?qlt=100&wid=900&ts=1689883691676&$ImageComponent$&fit=constrain', null, 'Perennial', 'Rattlesnake master grows wild in Illinois prairies and woodland openings in scattered locations throughout the state. The blue-green leaves develop in a cluster at the base. Each leaf is fairly uniform in length, like a sword blade, and has small spines along the edge. A single leaf may be up to two and one-half feet long. The tiny white flowers are clustered in a sphere. Each sphere has its own stalk that develops from the plant\'s single stem. Rattlesnake master blooms from July through August. The plant may reach three to five feet in height. Early settlers thought that the plant was good for the treatment of rattlesnake bite, thus the common name of “rattlesnake master.” It was not effective for that purpose, however.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygjul2009.html'), 
  new Plant('Red Cedar', 'Juniperus virginiana', 'Coniferophyta', 'Pinopsida', null, 'Pinales', 'Cupressaceae Gray', 'Cypress family', 'Juniperus L.', 'Juniperus virginiana L.', 'https://s7d1.scene7.com/is/image/isp/fygdec2008?qlt=100&wid=900&ts=1689612367456&$ImageComponent$&fit=constrain', null, 'Perennial', 'Red cedar is a medium-sized tree with red-brown bark that splits into long shreds. Two types of leaves are present: tiny flat, triangular leaves that are arranged opposite each other on the stem; and needlelike leaves that may be up to three-fourths inch long. Leaf color varies and may be blue-green, green or yellow-green. Male and female flowers develop on separate trees. The flowers are tiny. The spherical fruit developing from the flowers is dark blue with a white covering, berrylike and contains one or two seeds. Well-drained soil is the preferred habitat for this tree. The densely packed branches and evergreen leaves provide good roosting spots for birds in the winter. Berries are an excellent wildlife food source, too.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygdec2008.html'), 
  new Plant('Redosier Dogwood', 'Cornus sericea', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Cornales', 'Cornaceae Bercht. & J. Presl', 'Dogwood family', 'Cornus L.', 'Cornus sericea L.', 'https://s7d1.scene7.com/is/image/isp/fygaug2021?qlt=100&wid=900&ts=1689691203713&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Red-osier dogwood grows in marshes, calcareous fens and along shorelines. It may be found statewide, but it is much more common in the northern one-half of the state than anywhere else in Illinois. It is a shrub that can attain a height of three to nine feet. It has red twigs that can add color to a garden in winter. Flat clusters of white flowers are borne at the tip of the stems and are produced from May through September. Its fruits are one-seeded, white berries. The flowers provide nectar and pollen for pollinators. The fruits are eaten by a variety of wildlife species, especially birds.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygaug2021.html'), 
  new Plant('Redbud', 'Cercis canadensis', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Cercis L.', 'Cercis canadensis L.', 'https://s7d1.scene7.com/is/image/isp/fygmar2009?qlt=100&wid=900&ts=1689613430885&$ImageComponent$&fit=constrain', null, 'Perennial', 'The clusters of red-purple flowers on the redbud tree are distinctive. They bloom in early spring before the leaves unfurl. Each flower is about one-half inch in length. The leaf is heart-shaped with smooth edges and a small point at the tip. Leaves are arranged alternately along the stem. The redbud tree grows best in well-drained to moderately well-drained soil. The tree may eventually reach a height of 20-30 feet but grows slowly. In a forest, it is a part of the understory, so it is tolerant of shade. The tree crown is usually broad and flattened. The fruits are legumes (similar to pea pods) with several seeds. The bark is red-brown and separates into plates and scales. Redbud grows naturally throughout most of Illinois.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygmar2009.html'), 
  new Plant('River Birch', 'Betula nigra', 'Magnoliophyta', 'Magnoliopsida', 'Hamamelididae', 'Fagales', 'Betulaceae Gray', 'Birch family', 'Betula L.', 'Betula nigra L.', 'https://s7d1.scene7.com/is/image/isp/fygjan2012?qlt=100&wid=600&ts=1689601865533&$ImageComponent$&fit=constrain', null, 'Perennial', 'River birch grows naturally throughout much of Illinois, although it is more common in the southern half of the state. It grows along streams and in floodplain forests. This tree may reach 75 feet in height. Male and female flowers are present on the same tree, with flowering occurring in April and May. The flowers are small, with the male flowers in drooping clusters, and the female flowers in conelike structures. The fruits produced are winged, tiny, hairy nuts. The simple leaves are arranged alternately on the stem, and a leaf may be up to three inches long. The leaves are doubly toothed along the edge. The bark is red-brown. It shreds and peels from the trunk, providing an interesting look that can enliven your garden.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygjan2012.html'), 
  new Plant('Rosinweed', 'Silphium integrifolium', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Silphium L.', 'Silphium integrifolium Michx.', 'https://s7d1.scene7.com/is/image/isp/bnrosinweed?qlt=100&wid=900&ts=1689704966776&$ImageComponent$&fit=constrain', null, 'Perennial', 'Rosinweed grows in prairies statewide. The plant is about two to three feet tall when mature. The stems usually have paired leaves with no stalks, although the arrangement and shape of the leaves varies greatly. The leaves are rough to the touch. Flower heads are produced on short stalks at the stem tips in July and August. The flower heads contain yellow ray flowers surrounding yellow-green disk flowers. It is called “rosinweed” due to the resinlike sap that the plant produces. This plant provides nectar and pollen for native pollinator species.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygoct2015.html'), 
  new Plant('Rough Blazing-star', 'Liatris aspera', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Liatris Gaertn. ex Schreb.', 'Liatris aspera Michx.', 'https://s7d1.scene7.com/is/image/isp/bnroughbstar?qlt=100&wid=900&ts=1689884463915&$ImageComponent$&fit=constrain', null, 'Perennial', 'Rough blazing-star is found statewide in black soil prairies and savannas. A single plant may attain a height of up to 30 inches. This member of the aster family has unbranched stems with alternate leaves. The leaves decrease in size from the bottom of the stem to the top. Both the leaves and stem are hairy. Blue-purple to red-pink flowers are produced from July through September. The flowers develop in clusters of 25-40 with the clusters either attached directly to the stem or on a very short stalk. Bracts  below the flower heads are rounded with definite, curled margins. Pollinators are attracted to the nectar and pollen from this species.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygapr2018.html'), 
  new Plant('Round-lobed Hepatica', 'Hepatica americana', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Hepatica', 'H. americana', 'https://s7d1.scene7.com/is/image/isp/fygmar2022?qlt=100&wid=900&ts=1689612160541&$ImageComponent$&fit=constrain', 'Photo © Christopher David Benda', 'Perennial', 'This plant has three lobes per leaf, and each lobe is rounded. The leaf and flower stalk are hairy. Flowers may be white, pink, lavender or blue and are composed of sepals. There is one flower per stalk. Three bracts are present below each flower. An individual plant grows four to six inches tall. Round-lobed hepatica grows in rich woods in northeastern Illinois. it blooms in March and April. The flowers close at night and when precipitation is falling. The fruit is an achene, a simple dry fruit that does not open at maturity. It contains one seed.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygmar2022.html'), 
  new Plant('Sand Coreopsis', 'Coreopsis lanceolata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Coreopsis L.', 'Coreopsis lanceolata L.', 'https://s7d1.scene7.com/is/image/isp/bnsandcoreopsis?qlt=100&wid=900&ts=1689613223219&$ImageComponent$&fit=constrain', null, 'Perennial', 'Sand coreopsis is also known as lanceleaf coreopsis or tickseed. It grows statewide in dry prairies and areas with dry, sandy or rocky soil. The mature plant may reach a height of one to two feet. Leaves develop at the plant’s base with a few pairs of opposite leaves also on the stem. Leaves are lance-shaped and may have two projections at the bottom. Flowers are produced from May through August on individual stalks at the top of the plant. Each flower has eight to 10 yellow ray flowers each with four to five jagged projections at the tip.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygfeb2017.html'), 
  new Plant('Sassafras', 'Sassafras albidum', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Laurales', 'Lauraceae Juss.', 'Laurel family', 'Sassafras Nees & Eberm.', 'Sassafras albidum (Nutt.) Nees', 'https://s7d1.scene7.com/is/image/isp/fygdec2010?qlt=100&wid=900&ts=1689611867009&$ImageComponent$&fit=constrain', 'Photo © Illinois Department of Natural Resources, Guy Sternberg, Photographer', 'Perennial', 'Sassafras grows in the southern three-fourths of Illinois in upland areas with dry soil. It is often found in forest edges and fence rows. The sassafras tree may grow to a maximum height of about 70 feet. The bark is red-brown and furrowed. The leaves are arranged alternately on the smooth, green twigs. Three different leaf shapes can be found on a single tree. All of them are smooth along the edges and smooth on the upper leaf surface. The leaves provide brilliant shades of red, yellow and orange in fall. Flowers are yellow-green with male and female flowers produced on separate trees. Dark-blue berries are produced in the fall, and they provide a good food source for birds and other wildlife.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygdec2010.html'), 
  new Plant('Sawtooth Sunflower', 'Helianthus grosseserratus', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Helianthus L.', 'Helianthus grosseserratus M. Martens', 'https://s7d1.scene7.com/is/image/isp/fygoct2011?qlt=100&wid=900&ts=1689692927396&$ImageComponent$&fit=constrain', null, 'Perennial', 'Sawtooth sunflower blooms from July through October throughout Illinois. It can be found in prairies, in wet areas by ditches and meadows and along the edges of woods where sunshine is abundant. This plant\'s stem is smooth, although the leaves have hairs. The leaves are arranged alternately along the stem. Leaves may reach a maximum of eight inches long and two inches wide. Leaves are toothed along the edges. The plant generally grows from three to five feet tall. Flowers develop in clusters. The ray and disc flowers are both yellow.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygoct2011.html'), 
  new Plant('Seneca Snakeroot', 'Polygala senega', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Polygalales', 'Polygalaceae Hoffmanns. & Link', 'Milkwort family', 'Polygala L.', 'Polygala senega L.', 'https://s7d1.scene7.com/is/image/isp/fygjun2019?qlt=100&wid=900&ts=1689614273518&$ImageComponent$&fit=constrain', 'Photo ©  River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial','There are two varieties of Seneca snakeroot in Illinois: one lives in prairies and dry 0woods in the northern three-fourths of the state; the other variety is rare and grows in woods in the northern one-half of Illinois. The plant has multiple stems and may grow to about 20 inches tall. Flowers develop on a stalk at the tip of the central stem. Blooming occurs from May through September. Flower color is white or green. The fruit is a capsule with two seeds. Native bees are attracted to the flowers.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygjun2019.html'), 
  new Plant('Serviceberry', 'Amelanchier arborea', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Rosales', 'Rosaceae Juss.', 'Rose family', 'Amelanchier Medik.', 'Amelanchier arborea (Michx. f.) Fernald', 'https://s7d1.scene7.com/is/image/isp/fygfeb2012?qlt=100&wid=900&ts=1689692313250&$ImageComponent$&fit=constrain', null, 'Perennial', 'Serviceberry is also known as shadbush or Juneberry. This small tree may grow to about 20 feet in height with a maximum trunk diameter of eight inches. It has slender branches. Its clusters of white flowers are produced from March to May before the tree’s leaves appear. Flowers each have five petals. The leaves are simple, alternate and finely toothed. The fruit is applelike, up to one-fourth inch in diameter and with a red-purple coloration. The tree grows naturally in Illinois on wooded bluffs and slopes statewide.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygfeb2012.html'), 
  new Plant('Sessile Monkey-flower', 'Mimulus ringens', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Scrophulariales', 'Scrophulariaceae Juss.', 'Figwort family', 'Mimulus L.', 'Mimulus ringens L.', 'https://s7d1.scene7.com/is/image/isp/fygmar2020?qlt=100&wid=600&ts=1689600972255&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Sessile monkey-flower grows in wet areas in the northern three-fourths of the state. Flowers are produced from June through September. The flowers have blue-violet petals. The arrangement of the lobed petals is said to resemble a monkey\'s face. Flowers develop in pairs on long stalks from the leaf axils. The leaves are also paired and attached directly to the stem. A single plant may reach one to three feet in height. Bumblebees feed on the flower nectar, and the larval stages of several species of moths and butterflies feed on the leaves.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygmar2020.html'), 
  new Plant('Sharp-lobed Hepatica', 'Hepatica acutiloba', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Ranunculaceae Juss.', 'Buttercup family', 'Hepatica Mill.', 'Hepatica acutiloba Schreb.', 'https://s7d1.scene7.com/is/image/isp/fygmay2010?qlt=100&wid=900&ts=1700593145478&$ImageComponent$&fit=constrain', 'Photo © 2009, River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Sharp-lobed hepatica is a wildflower that grows in rich woodlands throughout Illinois. It blooms from March through May. Each leaf has three lobes, and each lobe has a sharp point. The plant grows to a height of four to nine inches. The leaf and flower stalks are hairy. Flower color varies and may be pink, purple, blue or white. There are six to 10 sepals present per flower. Sharp-lobed hepatica is a member of the buttercup family of plants.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygmay2010.html'), 
  new Plant('Shooting-star', 'Dodecatheon meadia', 'Magnoliophyta', 'Magnoliopsida', 'Dilleniidae', 'Primulales', 'Primulaceae Batsch', 'Primrose family', 'Dodecatheon L.', 'Dodecatheon meadia L.', 'https://s7d1.scene7.com/is/image/isp/fygjun2008?qlt=100&wid=900&ts=1689613507241&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'The unusual flowers of shooting-star may be pink or white and are produced in April and May. A native of moist prairies, open woods and meadows, all the leaves of this plant grow at its base. The flower stalk is slender and reaches one to two feet in height. The flowers develop at the tip of a stalk in a cluster. Each of the five petals points backward. They are joined at the base by a yellow tube. Five pollen-producing structures form a beak below where the petals meet.', '2008', 'https://dnr.illinois.gov/education/fygmain/2008/fygjun2008.html'), 
  new Plant('Showy Goldenrod', 'Solidago speciosa', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Solidago L.', 'Solidago speciosa Nutt.', 'https://s7d1.scene7.com/is/image/isp/fygoct2020?qlt=100&wid=600&ts=1689611777933&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Showy goldenrod is a perennial herb with a smooth, red stem. The leaves are arranged alternately along the stem, and the margins of the lower leaves have irregular edges. Yellow flowers develop in heads at the stem tip. There are five to six rays per flower. The one‐seeded fruit is dry and hard. Showy goldenrod may attain a height of two to six feet. This species may be found statewide in Illinois. It grows in open woods and prairies. Flowers are produced from August through October. The flowers are pollinated by insects. All parts of this plant may be eaten by wildlife.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygoct2020.html'), 
  new Plant('Showy Tick Trefoil', 'Desmodium canadense', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Desmodium Desv.', 'Desmodium canadense (L.) DC.', 'https://s7d1.scene7.com/is/image/isp/fygapr2020?qlt=100&wid=600&ts=1689604034427&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Showy tick trefoil is also known as Canada tick trefoil. This perennial herb has leaves in an alternate arrangement along the stems. Each of these compound leaves has three, long, oval leaflets. The five‐petaled, pink, blue or violet flowers develop in clusters at the top of a leafy, hairy stem. Each flower may be one‐half inch in length. The fruit is a hairy seedpod. Showy tick trefoil may attain a height of two to six feet. This species may be found statewide in Illinois. It grows in thickets, dry to moist prairies and lake edges. Flowers are produced from July through September.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygapr2020.html'), 
  new Plant('Side-oats Grama', 'Bouteloua curtipendula', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Bouteloua Lag.', 'Bouteloua curtipendula (Michx.) Torr.', ['https://s7d1.scene7.com/is/image/isp/fygoct2009?qlt=100&wid=600&ts=1689613638051&$ImageComponent$&fit=constrain', 'https://s7d1.scene7.com/is/image/isp/fygoct2009a?qlt=100&wid=600&ts=1689617489138&$ImageComponent$&fit=constrain'], null, 'Perennial', 'Side-oats grama is a grass that grows in dry soil in clumps or as single stems. It does not tolerate shade. Its leaves are flat and very narrow. Reaching two to three feet in height, it blooms in August and September. The name “side-oats” was given to this plant because the double-row of seed heads is only on one side of the stem. The leaves of this plant become red-orange in fall, making an attractive highlight to the late season garden. In Illinois, this plant grows naturally on bluffs along the Mississippi River and in the northern half of the state.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygoct2009.html'), 
  new Plant('Silky Aster', 'Symphyotrichum sericeum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum sericeum (Vent.) G.L. Nesom', 'https://s7d1.scene7.com/is/image/isp/fygjun2020?qlt=100&wid=600&ts=1689691344105&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Silky aster is a perennial plant that has leaves arranged alternately along the stems. These simple, entire, leaves are oblong in shape and sessile. The leaves are covered with silvery, silky hairlike structures. Violet or blue flowers are clustered in numerous flower heads. Each flower head has 15 to 25 rays. The one‐seeded fruit is dry and hard. Silky aster may attain a height of one to two feet. This species may be found in the northern one‐half of Illinois. It grows in dry prairies and sand barrens. Flowers are produced from September through October. Flowers are pollinated by insects.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygjun2020.html'), 
  new Plant('Skunk Cabbage', 'Symplocarpus foetidus', 'Magnoliophyta', 'Liliopsida', 'Arecidae', 'Arales', 'Araceae Juss.', 'Arum family', 'Symplocarpus Salisb. ex W.P.C. Barton', 'Symplocarpus foetidus (L.) Salisb. ex W.P.C. Barton', 'https://s7d1.scene7.com/is/image/isp/fygsep2019?qlt=100&wid=900&ts=1689601096515&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'The skunk cabbage is a perennial herb. It has no stems. The smooth leaves, which may be up to two and one‐half feet long and nearly one foot wide, are produced after flowering. The flowers are located close to the ground on a thickened structure that is surrounded by a purple-to-green sheath. The fruits are berries. The skunk cabbage grows in swamps, fens and other wet areas. This plant flowers from February through March.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygsep2019.html'), 
  new Plant('Smooth Aster', 'Symphyotrichum laeve', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Symphyotrichum Nees', 'Symphyotrichum laeve (L.) Á. Löve & D. Löve', 'https://s7d1.scene7.com/is/image/isp/bnsmoothaster?qlt=100&wid=900&ts=1701202403304&$ImageComponent$&fit=constrain', null, 'Perennial', 'Smooth aster is found in prairies, roadsides, fens and on rock ledges statewide. A single plant may attain a height of up to 36 inches. This member of the aster family has smooth stems with a blue-green appearance to the stems and leaves. Leaves clasp the stem. The flower heads have violet to blue ray flowers and are produced from July through October. Pollinators are attracted to the pollen and nectar of the flowers.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygaug2018.html'), 
  new Plant('Smooth Sumac', 'Rhus glabra', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Sapindales', 'Anacardiaceae R. Br.', 'Sumac family', 'Rhus L.', 'Rhus glabra L.', 'https://s7d1.scene7.com/is/image/isp/fygjan2022?qlt=100&wid=900&ts=1701887563717&$ImageComponent$&fit=constrain', null, 'Perennial', 'Smooth sumac is a small, deciduous tree or shrub. Its twigs are red-brown or green-brown and covered with a white coating. Its compound leaves may have as many as 31 leaflets. Male (staminate) and female (pistillate) flowers are generally on separate plants. The small, green-white flower clusters develop in June and July. The fruit is a small, red drupe (a seed enclosed in a hard, dry material that in turn is covered with a fleshy material). Drupes are covered with tiny hairs. Smooth sumac grows throughout Illinois in prairies, roadsides, fields and woods. Its leaves and fruits turn bright red in fall. The flowers are a good source of pollen and nectar for many pollinating insects, and the fruits help sustain many songbirds and game birds in the winter.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygjan2022.html'), 
  new Plant('Solomon\'s-seal', 'Polygonatum commutatum', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Polygonatum Mill.', 'Polygonatum commutatum', 'https://s7d1.scene7.com/is/image/isp/fygdec2018?qlt=100&wid=900&ts=1689611722594&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Solomon’s-seal, a member of the lily family, grows in woodlands and other shady places throughout Illinois. A plant may reach about three and one-half feet tall. Each plant has one stem, and the stem leans to one side. Leaves are alternately arranged and placed close together. Blooming occurs from April through June. Flowers develop in the leaf axils of the upper half of the plant and hang below the stem in clusters of two to five flowers. Flower color is white-green to yellow-green. Fertilized flowers produce a berry that becomes dark-purple in color when mature. Pollinating insects and hummingbirds are attracted to the flowers. Some wildlife species also eat the berries.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygdec2018.html'), 
  new Plant('Spicebush', 'Lindera benzoin', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Laurales', 'Lauraceae Juss.', 'Laurel family', 'Lindera Thunb.', 'Lindera benzoin (L.) Blume', 'https://s7d1.scene7.com/is/image/isp/fygjan2013?qlt=100&wid=600&ts=1689617568831&$ImageComponent$&fit=constrain', null, 'Perennial', 'Spicebush is a shrub that thrives naturally in rich, moist woods in the southern half of Illinois. It prefers to grow in full sun or partial shade. The leaves are simple, alternate, up to six inches long and three inches wide. The yellow flowers open in spring before the leaves appear. Blooming occurs from March to May, with the flowers arranged in clusters along the stems. Male and female flowers are on separate plants. The red fruits are about three-eighths to one-half inch long and have a slight indentation at the tip. All parts of this plant, including the flowers and fruits, have a spicy aroma. The spicebush swallowtail butterfly (Papilio troilus) lays eggs on this plant, and its larvae feed on the leaves. Songbirds and upland game birds eat the fruits. Deer and other mammals feed on the shrub as well.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygjan2013.html'), 
  new Plant('Spiderwort', 'Tradescantia L.', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Commelinales', 'Commelinaceae Mirb.', 'Spiderwort family', 'Tradescantia L.', 'Tradescantia', 'https://s7d1.scene7.com/is/image/isp/bnspiderwort?qlt=100&wid=900&ts=1689612560885&$ImageComponent$&fit=constrain', null, 'Perennial', 'Several species of spiderwort grow in the woods and prairies of Illinois. They bloom from April through August. The blue-violet flowers each have their own stalk, but they are arranged in clusters at the tip of the stem. Each flower has three petals. A flower only lasts for a single day, but the plant is prolific in producing flowers. The long, narrow leaves are arranged alternately on the stem. A single plant may reach a maximum of about three feet in height.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygmay2009.html'), 
  new Plant('Spiked Lobelia', 'Lobelia spicata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Campanulales', 'Campanulaceae Juss.', 'Bellflower family', 'Lobelia L.', 'Lobelia spicata Lam.', 'https://s7d1.scene7.com/is/image/isp/fygjan2015?qlt=100&wid=600&ts=1689602571503&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Spiked lobelia grows in dry woodlands and prairies throughout the state. The plant reaches one to two and one-half feet in height. It has white-colored sap. Leaves are arranged alternately on the stem. Each leaf is lance-shaped and shows only slight indentations on the margins. Flowers appear in July and August in a spike. Flower color ranges from white to blue. Each flower has two narrow lobes on top and three wider ones on the bottom, all of which unite in a tube at their base.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygjan2015.html'), 
  new Plant('Spotted Joe-pye-weed', 'Eutrochium maculatum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Eutrochium Raf.', 'Eutrochium maculatum (L.) E.E. Lamont', 'https://s7d1.scene7.com/is/image/isp/fygnov2016?qlt=100&wid=600&ts=1701185589683&$ImageComponent$&fit=constrain', null, 'Perennial','Spotted Joe-pye-weed grows throughout Illinois, although it is common only in the northern one-half of the state. It can be found in marshes and fens. This plant may attain a height of two to seven feet. Its leaves are arranged in whorls around the stem with four or five leaves per whorl. The stem is speckled with purple or is mostly purple. Flowers are produced from June through October. The flowers are violet and have five petals. They develop in a flat-topped cluster at the stem tip. Both disk and ray flowers are present. The one-seeded fruit is dry and hard. The flowers of this species provide food for many pollinators.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygnov2016.html'), 
  new Plant('Spotted Touch-me-not', 'Impatiens capensis', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Geraniales', 'Balsaminaceae A. Rich.', 'Touch-me-not family', 'Impatiens L.', 'Impatiens capensis Meerb.', 'https://s7d1.scene7.com/is/image/isp/fygjun2015?qlt=100&wid=900&ts=1701105854259&$ImageComponent$&fit=constrain', null, 'Annual', 'Spotted touch-me-not, or jewelweed, grows in shady areas with wet soil statewide. The plant may reach two to five feet in height. Its leaves are thin, and the stem is very succulent. Flowers are produced from June through October and hang singly from a stalk. Flowers are orange with darker orange spots. The spur at the end of the flower curves forward toward the flower\'s opening. The fruits are pods. When ripe, a touch causes the pod to explode and expel its seeds a good distance from the plant.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygjun2015.html'), 
  new Plant('Spring Beauty', 'Claytonia virginica', 'Magnoliophyta', 'Magnoliopsida', 'Caryophyllidae', 'Caryophyllales', 'Portulacaceae Dumort.', 'Purslane family', 'Claytonia L.', 'Claytonia virginica L.', 'https://s7d1.scene7.com/is/image/isp/fygapr2021?qlt=100&wid=900&ts=1701883607855&$ImageComponent$&fit=constrain', null, 'Perennial', 'Spring beauty grows in woodlands and lawns throughout the state. There are two leaves per plant. This species is one of the first to flower in spring, blooming from March through June. Its petals are white or pink with darker-pink veins. The plant has only a single stem, and flowers appear at the tip. Spring beauty may attain a height of six to 12 inches.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygapr2021.html'), 
  new Plant('Spring Cress', 'Cardamine bulbosa', 'Magnoliophyta', 'Magnoliopsida', 'Dilleniidae', 'Capparales', 'Brassicaceae Burnett ', 'Mustard family', 'Cardamine L.', 'Cardamine bulbosa (Schreb. ex Muhl.) Britton, Sterns & Poggenb.', 'https://s7d1.scene7.com/is/image/isp/fygmar2014?qlt=100&wid=600&ts=1689691445265&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Spring cress, also known as bulbous cress, grows throughout Illinois along streams and in moist woodlands. This plant of the mustard family blooms from March through June. The flowers are clustered at the stem tip. Each flower has four white petals. The leaves at the base of the plant are rounded, and each grows on a long stalk. The plant can grow from eight to 20 inches tall and has roots that are shaped like bulbs.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygmar2014.html'), 
  new Plant('Starry Solomon\'s-seal', 'Smilacina stellata', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Maianthemum F.H. Wigg.', 'Maianthemum stellatum (L.) Link', 'https://s7d1.scene7.com/is/image/isp/fygaug2019?qlt=100&wid=900&ts=1689692027712&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Starry Solomon’s‐seal is a perennial plant that grows from thick, underground stems. Its aboveground stems are upright, unbranched, smooth or finely hairy. Leaves are alternate, lance‐shaped to oval and clasp the stem. The white flowers are arranged in a panicle at the end of the stem. The fruits are spherical, blue-black or black berries. Starry Solomon’s‐seal may be found in the northern three-fifths of Illinois plus St. Clair, Wabash and Crawford counties. This plant grows in woods and prairies. Flowers are produced from May through June.', '2019', 'https://dnr.illinois.gov/education/fygmain/2019/fygaug2019.html'), 
  new Plant('Stiff Aster', 'Oligoneuron album', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Oligoneuron Small', 'Oligoneuron album (Nutt.) G.L. Nesom', 'https://s7d1.scene7.com/is/image/isp/fygnov2022?qlt=100&wid=900&ts=1689600562410&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Stiff aster, also known as white goldenrod, prairie goldenrod and several other names is a perennial herb. It looks like an aster, and was once classified as an aster, but it is a goldenrod. Its leaves are arranged alternately along the stem. The leaves are simple, entire or toothed and linear or lance‐shaped. White flowers are arranged in heads. Flowers contain both ray and disk flowers. The one‐seeded fruit, an achene, is dry and hard. This plant may attain a height of one to two feet. Stiff aster may be found in the northern one‐half of Illinois. It grows in dry prairies and sandy soil. Flowers are produced from August through September. Insects are the main agent of pollination.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygnov2022.html'), 
  new Plant('Stiff Goldenrod', 'Oligoneuron rigidum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Oligoneuron Small', 'Oligoneuron rigidum (L.) Small', 'https://s7d1.scene7.com/is/image/isp/bnsgoldenrod?qlt=100&wid=900&ts=1689689687279&$ImageComponent$&fit=constrain', null, 'Perennial', 'Stiff goldenrod is a perennial herb that has hairy leaves in an alternate arrangement along the hairy stem. The stiff, lance-shaped upper leaves clasp the stem. Lower leaves are large, oblong, short-stalked and rough. The small, yellow flowers develop in a broad, flat-topped cluster at the stem tip. Both disk and ray flowers are present, and both are fertile. There are six to 14 rays per flower. The one-seeded fruit is dry and hard. This plant may attain a height of one to five feet. Stiff goldenrod may be found statewide in Illinois, although it is uncommon in the southern tip of the state. It grows in dry to moist prairies, dry thickets, sandy soil and rocky, open ground. Flowers are produced from July through October. Flowers, leaves, stems and buds all provide food for wildlife.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygjan2017.html'), 
  new Plant('Sumac', 'Rhus sp.', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Sapindales', 'Anacardiaceae R. Br.', 'Sumac family', 'Rhus L.', null, 'https://s7d1.scene7.com/is/image/isp/fygnov2009?qlt=100&wid=900&ts=1700589467481&$ImageComponent$&fit=constrain', null, 'Perennial', 'Several species of sumac can be grown successfully in your garden. They prefer dry soil but will tolerate other conditions, too. While some species may grow to a height of 20 feet, others are much shorter. Some sumac species have large compound leaves with many leaflets. Fragrant, or aromatic, sumacs have only three leaflets per leaf, and the plants are much shorter. Sumacs are compact shrubs producing green flowers in May and June that result in clusters of fleshy, red fruits in the fall. The fruits persist in winter and add color and interest to your landscape as well as providing food for wildlife. Sumac leaves turn brilliant red or yellow in autumn.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygnov2009.html'), 
  new Plant('Swamp Marigold', 'Bidens aristosa', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Bidens L.', 'Bidens aristosa (Michx.) Britton', 'https://s7d1.scene7.com/is/image/isp/fygaug2022?qlt=100&wid=900&ts=1673474778969&$ImageComponent$&fit=constrain', null, ['Annual', 'Perennial'], 'Swamp marigold is also known as tickseed sunflower, bearded beggarticks, bur marigold and several other common names. In Illinois it grows statewide in wet soil. It reaches a height of three to four feet, has deeply divided, toothed leaves and large, yellow flower heads. Leaves are opposite each other on the stem. Flowers are produced from August through October. The plant has many branches and numerous flower clusters are present at once. There are typically seven or eight ray flowers per flower head. The fruit is an achene, a simple dry fruit that does not open at maturity. In this species, it may have barbs. Many pollinating insects are attracted to the flowers.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygaug2022.html'), 
  new Plant('Swamp Milkweed', 'Asclepias incarnata', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Gentianales', 'Asclepiadaceae Borkh.', 'Milkweed family', 'Asclepias L.', 'Asclepias incarnata L.', 'https://s7d1.scene7.com/is/image/isp/bnsmilkweed?qlt=100&wid=900&ts=1689705071228&$ImageComponent$&fit=constrain', null, 'Swamp milkweed grows in marshes, wet fields and along the shores of ponds, lakes and streams throughout Illinois. Flowering occurs from June through August. The flowers are dark pink and may have a white center. Flowers are produced in a cluster at the stem tip, with each flower on its own stalk. Although there are many flowers in a cluster, usually only a few of them are pollinated. The pollinated flowers develop into large pods that contain seeds attached to silky plumes. These plants may grow to nearly five feet tall. Their leaves are arranged oppositely on the stem. Each leaf may be up to six inches long and one inch wide. The sap of swamp milkweed is white. Monarch butterfly larvae are among the few organisms that are able to eat milkweed leaves. Many pollinators are attracted to the flowers, however.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygjul2014.html'), 
  new Plant('Swamp Rose Mallow', 'Hibiscus moscheutos', 'Magnoliophyta', 'Magnoliopsida', 'Dilleniidae', 'Malvales', 'Malvaceae Juss.', 'Mallow family', 'Hibiscus L.', 'Hibiscus moscheutos L.', 'https://s7d1.scene7.com/is/image/isp/bnswamprosemallow?qlt=100&wid=900&ts=1689705180514&$ImageComponent$&fit=constrain', null, ['Annual', 'Perennial'], 'Swamp rose mallow grows in wet soil in a few scattered locations in eastern and southern Illinois. It is found in open swamps and marshes and around ponds, lakes and rivers where there is full to partial sunshine during the day, wet soil and plenty of soil nutrients. The plants reach three to seven feet in height. Flowers are produced from July through September. These large flowers are pink or white and resemble in appearance those of the tropical Hibiscus plants sold in garden centers and to which they are related. The fruits are produced in a capsule, and the plant spreads by seeds. This plant is pollinated by insects and attracts many pollinator species.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygjun2017.html'), 
  new Plant('Swamp White Oak', 'Quercus bicolor', 'Magnoliophyta', 'Magnoliopsida', 'Hamamelididae', 'Fagales', 'Fagaceae Dumort.', 'Beech family', 'Quercus L.', 'Quercus bicolor Willd.', 'https://s7d1.scene7.com/is/image/isp/fygjan2011?qlt=100&wid=900&ts=1689612933382&$ImageComponent$&fit=constrain', null, 'Perennial', 'Swamp white oak grows throughout Illinois. It thrives in soil that is poorly drained as well as in soil that is dry. The tree may reach 100 feet in height. Leaves are up to six inches long and four inches wide. The leaves have rounded teeth and shallow lobes. Leaves turn yellow/brown in the fall. The tiny flowers do not have petals. Male flowers develop in drooping clusters. Female flowers are in bunches of two to four. Acorns are one to one and one half inches long and provide food for wildlife. The wood of this tree is very strong.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygjan2011.html'), 
  new Plant('Sweet Black-eyed Susan', 'Rudbeckia subtomentosa', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Rudbeckia L.', 'Rudbeckia subtomentosa Pursh', 'https://s7d1.scene7.com/is/image/isp/bnsweetbesusan?qlt=100&wid=900&ts=1689705139906&$ImageComponent$&fit=constrain', 'Photo © Gerald D. Tang', 'Perennial', 'Sweet black-eyed Susan, also known as fragrant coneflower or sweet coneflower, is found in prairies, open woods and thickets statewide. A single plant may attain a height of up to 48 inches. This member of the aster family has stems that are hairy on their upper portions and smooth nearer the base. The lower leaves have three divisions while the upper leaves are entire. The flower heads are yellow (ray flowers) with dark centers (disk flowers). Several flower heads, each on its own stalk, are produced at the top of the plant. Flowers are generally present from July through September. Pollinators are attracted to the pollen and nectar of the flowers.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygsep2018.html'), 
  new Plant('Switchgrass', 'Panicum virgatum', 'Magnoliophyta', 'Liliopsida', 'Commelinidae', 'Cyperales', 'Poaceae Barnhart', 'Grass family', 'Panicum L.', 'Panicum virgatum L.', 'https://s7d1.scene7.com/is/image/isp/bnswitchgrass?qlt=100&wid=900&ts=1689603073148&$ImageComponent$&fit=constrain', null, 'Perennial','Switch grass grows throughout Illinois in prairies, woods, fields, disturbed soil and along some streams. The plant may reach three to six feet in height. This species grows in erect clumps. Flowers are arranged in a loosely branched cluster at the stem tip. The flowering head may be as much as 16 inches long. It is widest at the base and narrows toward the top to make a pyramidal shape. Switch grass blooms from July through October. The tiny flowers have red-purple anthers. The larvae of Leonard’s skipper (Hesperia leonardus), tawny-edged skipper (Polites themistocles), some other skipper butterflies and larvae and adults of several other insect species feed on the leaves. The seeds are eaten by birds and small mammals. The plant turns a red-brown color in the fall adding interest to your garden in fall and winter. It also provides shelter to small animals, especially in winter.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygaug2017.html'), 
  new Plant('Tall Alumroot', 'Heuchera americana', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Rosales', 'Saxifragaceae Juss.', 'Saxifrage family', 'Heuchera L.', 'Heuchera americana L.', 'https://s7d1.scene7.com/is/image/isp/bnalumroot?qlt=100&wid=900&ts=1701881663337&$ImageComponent$&fit=constrain', null, 'Perennial', 'Tall alumroot may be found in the southern two-thirds of Illinois as well as in Cook and Jo Daviess counties. It grows in dry woodlands. Flowers are produced in May and June. The flowers are bell-shaped. They hang down from small stems on a long, flowering stalk. The petals are generally green but may show some red. Flowering stalks may reach two to three feet in height. The leaves are basal and have an appearance somewhat like maple tree leaves.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygfeb2020.html'), 
  new Plant('Tall Boneset', 'Eupatorium altissimum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Eupatorium L.', 'Eupatorium altissimum L.', 'https://s7d1.scene7.com/is/image/isp/bntallboneset?qlt=100&wid=900&ts=1701879689743&$ImageComponent$&fit=constrain', null, 'Perennial', 'Tall boneset is also known as tall thoroughwort. This perennial herb has pointed, stalkless leaves. The paired leaves are opposite each other on the stem. Each simple, entire, toothed leaf is lance‐shaped or oval. Clusters of white flowers are borne in small, fuzzy heads. The one‐seeded fruit is dry and hard. Tall boneset may attain a height of eight feet. Tall boneset may be found statewide in Illinois. It grows in open woods, lake edges, old fields and prairies. Flowers are produced from August through October. It is a good plant for pollinators.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygjul2020.html'), 
  new Plant('Three-leaved Stonecrop', 'Sedum ternatum', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Rosales', 'Crassulaceae J. St.-Hil.', 'Stonecrop family', 'Sedum L.', 'Sedum ternatum Michx.', 'https://s7d1.scene7.com/is/image/isp/fygdec2022?qlt=100&wid=600&ts=1689613399407&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Three-leaved stonecrop grows on rocky cliffs and in forest ravines in scattered location statewide where the substrate is moist. The plant may reach eight inches tall. It only branches at the base. It grows as a ground cover with taller flower stalks. Leaves are fleshy. Flowers develop in clusters on fertile shoots. There are four white petals and four green sepals per flower. Flowering occurs from May through June. Tiny seeds are produced from fertile flowers and are so small that they may be carried by wind. Stems can form rootlets where they touch the ground, so these plants often grow in colonies. The flowers attract some pollinating insects, mainly bees.', '2022', 'https://dnr.illinois.gov/education/fygmain/2022/fygdec2022.html'), 
  new Plant('Toothwort', 'Cardamine concatenata', 'Magnoliophyta', 'Magnoliopsida', 'Dilleniidae', 'Capparales', 'Brassicaceae Burnett', 'Mustard family', 'Cardamine L.', 'Cardamine concatenata (Michx.) Sw.', 'https://s7d1.scene7.com/is/image/isp/fygfeb2010?qlt=100&wid=600&ts=1689692820440&$ImageComponent$&fit=constrain', 'Photo © 2009, River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Toothwort, also known as pepper-root, grows to about one foot in height. Leaves develop at the base of the plant as well as in a whorl of three below the flowers. The leaves are lobed and usually toothed. Flowers are up to three-fourths inch long and develop in clusters at the stem tip. Flower petals may be white, pale lavender or pink. The fruit is long (up to one and one-half inches) and slender, with a single row of seeds. Flowering occurs from late February through May in woodlands throughout the state. Toothwort is one of the first wildflowers to bloom each year in Illinois.', '2010', 'https://s7d1.scene7.com/is/image/isp/fygfeb2010?qlt=100&wid=600&ts=1689692820440&$ImageComponent$&fit=constrain'), 
  new Plant('Tulip Poplar', 'Liriodendron tulipifera', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Magnoliales', 'Magnoliaceae Juss', 'Magnolia family', 'Liriodendron L.', 'Liriodendron tulipifera L.', 'https://s7d1.scene7.com/is/image/isp/fygmay2013?qlt=100&wid=900&ts=1689691610389&$ImageComponent$&fit=constrain', null, 'Perennial', 'The tulip poplar is also known as the tuliptree. It is native to eastern and southern Illinois but is widely planted in the state as an ornamental tree, too. It grows in moist, rich upland forests. It may reach a height of 120 feet. The oblong or pyramidal shape is distinctive. Flowers are about two inches long and open in May. They consist of six petals, each yellow-green with an orange base. The leaves have four large lobes, usually with a notch between the upper lobes. The winged seeds produced by the flowers provide food for wildlife in the fall and winter.', '2013', 'https://dnr.illinois.gov/education/fygmain/2013/fygmay2013.html'), 
  new Plant('Twayblade Orchid', 'Liparis liliifolia', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Orchidales', 'Orchidaceae Juss.', 'Orchid family', 'Liparis Rich.', 'Liparis liliifolia (L.) Rich. ex Ker Gawl.', 'https://s7d1.scene7.com/is/image/isp/fygjan2016?qlt=100&wid=600&ts=1689702808507&$ImageComponent$&fit=constrain', 'Photo © 2016, River Valley Photographic Resources Ltd., rvprltd.com', 'Perennial', 'Twayblade orchid grows in woodlands throughout the state. It blooms from May through July. The flowers have three sepals and three petals. The two lateral petals are threadlike. The petal in the center has a broad lip. Flowers develop singly in a spike. The flowers are mauve-colored. The plant grows to a maximum of 10 inches in height. Two basal leaves are present.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygjan2016.html'), 
  new Plant('Twinleaf', 'Jeffersonia diphylla', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Ranunculales', 'Berberidaceae Juss.', 'Barberry family', 'Jeffersonia W. Bartram', 'Jeffersonia diphylla (L.) Pers. ', 'https://s7d1.scene7.com/is/image/isp/fygjun2014?qlt=100&wid=600&ts=1689693008428&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Twin-leaf is a member of the barberry family of plants. It grows in woodlands and blooms in April and May. It is rarely found in the southern one-third of the state but is fairly common in the northern two-thirds of Illinois. The flowers are white and have eight petals. The distinctive leaves have the appearence of being almost completely pinched into two parts in the center, leading to the name of "twin-leaf." The plants are about eight inches tall when in flower but will grow to a height of about 16 inches.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygjun2014.html'), 
  new Plant('Virginia Waterleaf', 'Hydrophyllum virginianum', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Solanales', 'Hydrophyllaceae R. Br.', 'Waterleaf family', 'Hydrophyllum L.', 'Hydrophyllum virginianum L.', 'https://s7d1.scene7.com/is/image/isp/fygapr2014?qlt=100&wid=900&ts=1701101788614&$ImageComponent$&fit=constrain', null, 'Perennial', 'Virginia waterleaf grows in woodlands throughout Illinois. The name "waterleaf" comes from the coloration on the leaves that may give them the appearance of being stained with water. Flowers are produced from April through July and are white or pale purple, arising on a single stalk. Leaves are large and have five to seven lobes. The plant ranges from one to three feet tall.', '2014', 'https://dnr.illinois.gov/education/fygmain/2014/fygapr2014.html'), 
  new Plant('Wahoo', 'Euonymus atropurpureus', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Celastrales', 'Celastraceae R. Br.', 'Bittersweet family', 'Euonymus L.', 'Euonymus atropurpureus Jacq.', 'https://s7d1.scene7.com/is/image/isp/fygdec2009?qlt=100&wid=900&ts=1689691998034&$ImageComponent$&fit=constrain', 'Photo © John Muchow', 'Perennial', 'Wahoo grows naturally in Illinois along streams, in floodplain forests and in woods. It can be a small tree or shrub, but in either form this adaptable plant makes a nice addition to the landscaping. The leaves are simple and opposite each other on the stem. Each leaf is about two to five inches long and one to two inches wide with a finely toothed margin. Leaves turn pink to yellow in fall. Wahoo blooms from May through July. The flowers are purple, about one-half inch wide and develop in a cluster of 7-15. Each flower has four petals. The fruit are purple to red-pink and last into winter. They split open to reveal the bright red seeds that are good food for wildlife, particularly songbirds.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygdec2009.html'), 
  new Plant('Water Lotus', 'Nelumbo lutea', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Nymphaeales', 'Nelumbonaceae A. Rich.', 'Lotus-lily family','Nelumbo Adans.', 'Nelumbo lutea Willd.', 'https://s7d1.scene7.com/is/image/isp/fygmay2015?qlt=100&wid=600&ts=1689613736171&$ImageComponent$&fit=constrain', 'Photo © Lance Merry', null, 'Perennial','Water lotus grows in lakes, ponds and rivers in areas of standing water statewide. The stems are in the water, and the roots grow in mud under the water. The leaves are round and very large, from one to two and one-half feet in diameter. Each leaf is attached in the center to a long stalk and is usually held one to two feet above the water level. The leaf is depressed in the center resulting in somewhat of a bowl shape. The flowers are produced on separate stalks from July through August. Flowers are typically pale yellow and may be 10 inches wide. The fruits are spherical nuts that may be one-half inch in diameter. The leaves of this plant provide shelter for wildlife and fishes.', '2015', 'https://dnr.illinois.gov/education/fygmain/2015/fygmay2015.html'), 
  new Plant('Western Sunflower', 'Helianthus occidentalis', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Asterales', 'Asteraceae Bercht. & J. Presl', 'Aster family', 'Helianthus L.', 'Helianthus occidentalis Riddell', 'https://s7d1.scene7.com/is/image/isp/fygapr2017?qlt=100&wid=900&ts=1701194100609&$ImageComponent$&fit=constrain', null, 'Perennial', 'Western sunflower is a perennial herb with leaves arranged opposite each other on the stem. This plant may attain a height of one to three feet. Most of the large, rough, hairy leaves are found at the base of the plant. The stems are long and often red. The oval-shaped leaves may be toothed. Yellow flower heads develop on long stalks from July through October. Both disk (fertile) and ray (sterile) flowers are present. The one-seeded fruit is dry and hard. Western sunflower grows statewide in dry prairies and areas of sandy soil but is more common in the northern two-thirds of Illinois. Insects are the main agent of pollination.', '2017', 'https://dnr.illinois.gov/education/fygmain/2017/fygapr2017.html'), 
  new Plant('White Prarie Clover', 'Dalea candida', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Dalea L.', 'Dalea candida Michx. ex Willd.', 'https://s7d1.scene7.com/is/image/isp/fygsep2016?qlt=100&wid=900&ts=1689691527716&$ImageComponent$&fit=constrain', null, 'Perennial', 'White prairie clover grows in prairies throughout Illinois. Several stems develop from a single root. Stems may attain a height of up to two feet. Flowers are produced from June through October. Each flower has one large petal and four smaller ones. These small, white flowers are on cylindrical heads at the stem tip. Each flower spike may be up to two inches long. The leaves are arranged alternately along the stem and have five to nine thin leaflets. This species is good for attracting pollinators.', '2016', 'https://dnr.illinois.gov/education/fygmain/2016/fygsep2016.html'), 
  new Plant('White Trout Lily', 'Erythronium albidum', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Erythronium L.', 'Erythronium albidum Nutt.', 'https://s7d1.scene7.com/is/image/isp/fygjun2021?qlt=100&wid=900&ts=1701885441275&$ImageComponent$&fit=constrain', null, 'Perennial', 'White trout lily grows in woods and fields throughout Illinois. Flowers are borne in April and May. The petals are white, and there may be some yellow inside the flower and some purple on the back of the petals. There are two basal leaves. The leaves may be spotted with purple. A single plant may be six to nine inches tall.', '2021', 'https://dnr.illinois.gov/education/fygmain/2021/fygjun2021.html'), 
  new Plant('White Turtlehead', 'Chelone glabra', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Scrophulariales', 'Scrophulariaceae Juss.', 'Figwort family', 'Chelone L.', 'Chelone glabra L.', 'https://s7d1.scene7.com/is/image/isp/fygmay2020?qlt=100&wid=600&ts=1689617655607&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'White turtlehead grows in wet soil, bogs, fens and marshes. It is more commonly found in the northern half of the state than in the southern half. Flowers are produced from July through October. The flowers are produced in a cluster at the stem tip. Petals are white and in a tubular shape with two divisions. The upper section overhangs the lower section and acts to protect it. The lower section is a landing area for insects. This arrangement is said to resemble a turtle\'s head. The plant may grow to two to three feet in height and is a good species to plant for pollinators.', '2020', 'https://dnr.illinois.gov/education/fygmain/2020/fygmay2020.html'), 
  new Plant('White Wild Indigo', 'Baptisia alba', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Baptisia Vent.', 'Baptisia alba (L.) Vent.', 'https://s7d1.scene7.com/is/image/isp/bnwwindigo?qlt=100&wid=900&ts=1689883279365&$ImageComponent$&fit=constrain', null, 'Perennial', 'White wild indigo is a plant of prairies, woods, sandy areas and marshes. The gray-green plants can reach four feet in height. Spikes of pealike white flowers extend above the leaves. It blooms from May through August. Black seed pods develop from the flowers. The leaves are arranged alternately on the stem, and each leaf is composed of three leaflets. White wild indigo has a deep, extensive root system.', '2009', 'https://dnr.illinois.gov/education/fygmain/2009/fygaug2009.html'), 
  new Plant('Wild Bergamot', 'Monarda fistulosa', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Lamiales', 'Lamiaceae Martinov', 'Mint family', 'Monarda L.', 'Monarda fistulosa L.', 'https://s7d1.scene7.com/is/image/isp/fygjul2010?qlt=100&wid=900&ts=1689601303674&$ImageComponent$&fit=constrain', null, 'Perennial', 'Wild bergamot is a common wildflower throughout Illinois. Growing in dry woods, fields, prairies and roadsides, it produces flowers from May through August. A dense, rounded cluster of lavender flowers develops at the tip of each stem. Each flower is tubular and two-lipped, with the lower lip forming a landing platform for insect pollinators. These flowers are attractive to a variety of insects, including bees and some butterflies. Wild bergamot is classified in the mint family and has the square stem that is typical of these plants. The leaves are oppositely arranged, one to two inches wide and two to four inches long. Each leaf has a long tip and is toothed along the edges. The leaves contain tiny glands with aromatic oils. This species grows to a height of two to four feet and tends to develop in colonies. It does spread easily and may crowd out other plants if not kept in check.', '2010', 'https://dnr.illinois.gov/education/fygmain/2010/fygjul2010.html'), 
  new Plant('Wild Blue Iris', 'Iris virginica', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Iridaceae Juss.', 'Iris family', 'Iris L.', 'Iris virginica L.', 'https://s7d1.scene7.com/is/image/isp/bnwbiris?qlt=100&wid=900&ts=1700668352258&$ImageComponent$&fit=constrain', null, 'Perennial', 'Wild blue iris blooms from May through June in areas with predominantly wet soil throughout Illinois. The plant has a thick underground stem, or rhizome. One to several flowers develop on the tip of a stalk. Flowers contain three blue petals and three blue sepals with a yellow base. Leaves are flat and smooth, up to three feet long and one and one-half inches wide. The fruits are three-angled capsules, up to four inches long.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygjun2011.html'), 
  new Plant('Wild Geranium', 'Geranium maculatum', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Geraniales', 'Geraniaceae Juss.', 'Geranium family', 'Geranium L.', 'Geranium maculatum L.' ,'https://s7d1.scene7.com/is/image/isp/fygjun2012?qlt=100&wid=600&ts=1689602252307&$ImageComponent$&fit=constrain', 'Photo © River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Wild geranium can be found statewide in woodlands. This perennial plant grows from thick roots. The stems are hairy and sometimes branched. The leaves at the base of the plant are hairy, have three to five divisions and may be up to five inches wide. The stem leaves are hairy, develop in pairs and are smaller than the basal leaves. This plant may grow to a height of one to two feet. Flowers are produced from April through June. Flowers develop in a cluster at the tip of the stem. Each flower has five, rose-purple petals.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygjun2012.html'), 
  new Plant('Wild Ginger', 'Asarum canadense', 'Magnoliophyta', 'Magnoliopsida', 'Magnoliidae', 'Aristolochiales', 'Aristolochiaceae Juss.', 'Birthwort family', 'Asarum L.', '	Asarum canadense L.', 'https://s7d1.scene7.com/is/image/isp/fygfeb2011?qlt=100&wid=900&ts=1689691918824&$ImageComponent$&fit=constrain', 'Photo © 2011, River Valley Photographic Resources, Ltd., rvprltd.com', 'Perennial', 'Wild ginger blooms from April through May in rich woodlands throughout Illinois. This plant is a member of the mostly tropical Birthwort family. The leaves are heart-shaped and have hairy stalks. The plant grows from six to 12 inches tall. Flowers are red-brown with three sepals. The flower does not have petals. Flowers develop at ground level at the point where the two leaf stalks merge. These plants often grow thickly on the forest floor and provide good ground cover.', '2011', 'https://dnr.illinois.gov/education/fygmain/2011/fygfeb2011.html'), 
  new Plant('Wild Hyacinth', 'Camassia scilloides', 'Magnoliophyta', 'Liliopsida', 'Liliidae', 'Liliales', 'Liliaceae Juss.', 'Lily family', 'Camassia Lindl.', 'Camassia scilloides (Raf.) Cory', 'https://s7d1.scene7.com/is/image/isp/fygmay2012?qlt=100&wid=900&ts=1700673932532&$ImageComponent$&fit=constrain', null, 'Perennial', 'Wild hyacinth is a member of the lily family of plants and grows from a bulb. It can be found statewide in prairies and woodlands. The leaves arise from the base and are long and narrow. A single leaf may be up to 12 inches long. Flowers are produced from April through June. Flower color varies from white to light purple. Ten to 12 flowers develop at the end of a leafless stalk. Each flower has three petals, three sepals and six yellow stamens.', '2012', 'https://dnr.illinois.gov/education/fygmain/2012/fygmay2012.html'), 
  new Plant('Wild Lupine', 'Lupinus perennis', 'Magnoliophyta', 'Magnoliopsida', 'Rosidae', 'Fabales', 'Fabaceae Lindl.', 'Pea family', 'Lupinus L.', 'Lupinus perennis L.', 'https://s7d1.scene7.com/is/image/isp/fygmar2018?qlt=100&wid=600&ts=1689691738136&$ImageComponent$&fit=constrain', 'Photo © John Hilty', 'Perennial', 'Wild lupine is also known as old maid’s bonnet or sundial plant. This species may be found in the northern one-fourth of Illinois growing in dry or moist sandy soil, open woods and clearings. This perennial herb has leaves in an alternate arrangement along the stem. The palmately compound leaves have seven to nine leaflets. Leaves follow the sun’s path during the day and fold together at night. Flowers are produced from May through June. Blue, purple, pink or white flowers are borne on long spikes. The fruit is a fuzzy pod that is constricted between the seeds. Wild lupine may attain a height of one to two feet.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygmar2018.html'), 
  new Plant('Wild Petunia', 'Ruellia humilis', 'Magnoliophyta', 'Magnoliopsida', 'Asteridae', 'Scrophulariales', 'Acanthaceae Juss.', 'Acanthus family', 'Ruellia L.', 'Ruellia humilis Nutt.', 'https://s7d1.scene7.com/is/image/isp/fygoct2018?qlt=100&wid=900&ts=1701202957717&$ImageComponent$&fit=constrain', null, 'Perennial', 'Wild petunia, also known as hairy wild petunia, can be found statewide in Illinois in dry woods, on bluffs, along roads and railroads and in prairies. Stems are hairy and usually no more than one foot tall. Leaves are also covered with hairs. Leaves are arranged opposite each other on the stem. Flowers do not have stalks. They are produced at the base of leaves in the middle and upper sections of the plant with each flower lasting only about one day. Blooming occurs from May through October. Flowers are shades of blue and purple. Long-tongued bees are important pollinators of the flowers.', '2018', 'https://dnr.illinois.gov/education/fygmain/2018/fygoct2018.html')];
//Creating IDs for all the plants
plants.forEach((plant, index) => plant.id = index + 1);

module.exports = plants;